(3, NULL, NULL, 64, 'Pengaturan pendaan lebih terkoordinasi', 'Pencairan dana sering terlambat tidak sesuai jadwal', '2025-01-13 01:22:00', '2025-01-13 01:22:36'),
(4, NULL, NULL, 91, 'Mengintegrasikan surat pengumuman elektronik pada akun SSO per dosen', 'Informasi terkait hibah pengabdian belum tersampaikan secara masif sampai ke dosen.', '2025-01-13 01:23:24', '2025-01-13 01:23:56'),
(5, NULL, NULL, 95, 'Melaksanakan monev yang terkoordinasi', 'Terjadi inkonsistensi pelaksanaan menyesuaikan dengan kondisi dilapangan', '2025-01-13 01:24:47', '2025-01-13 01:25:08'),
(6, 35, NULL, 18, 'sfnfsnsfn', 'sfnsh', '2025-02-05 07:24:32', '2025-02-05 07:24:38'),
(7, NULL, 6, 102, NULL, 'kgjgo', '2025-02-05 08:01:00', '2025-02-05 08:01:00'),
(13, NULL, 3, 49, NULL, 'Interpretasi:\n\nTingkat kepuasan yang tinggi tercermin dari 79,6% responden yang menyatakan puas dan sangat puas terhadap ketepatan pencairan gaji dan tunjangan lainnya.\n\nMeski demikian, 20,4% responden menilai cukup puas atau tidak puas, yang mengindikasikan bahwa masih terdapat ketidakkonsistenan dalam proses pencairan atau kurangnya informasi yang diterima pegawai terkait proses tersebut.\n\nRekomendasi:\n\nPastikan proses pencairan gaji dan tunjangan dilakukan secara tepat waktu dan konsisten setiap bulan.\n\nPerkuat sistem informasi keuangan agar seluruh staf dapat memantau status pencairan secara transparan.\n\nLakukan sosialisasi rutin kepada dosen dan tenaga kependidikan terkait alur dan jadwal pencairan remunerasi agar tidak terjadi miskomunikasi atau ekspektasi yang tidak sesuai.', '2025-06-03 01:02:47', '2025-06-03 01:02:47'),
(14, NULL, 3, 15, NULL, 'Faktor Penyebab:\nProsedur layanan kesehatan kurang jelas atau membingungkan.\n\nInformasi layanan belum tersosialisasi secara luas.\n\nWaktu respons layanan cenderung lambat.\n\nFasilitas dan sumber daya layanan kesehatan terbatas.\n\nRencana Tindak Lanjut:\nMenyusun dan menyebarkan alur prosedur layanan secara visual (infografis/leaflet).\n\nMemberikan pelatihan kepada petugas tentang SOP dan etika pelayanan.\n\nMenambah jam operasional layanan kesehatan.\n\nMeningkatkan sarana dan prasarana layanan kesehatan.\n\nMelakukan survei kepuasan ulang setelah perbaikan dilakukan.', '2025-06-03 01:33:12', '2025-06-03 01:33:12'),
(15, NULL, 3, 8, NULL, 'Faktor Penyebab:\nSarana prasarana layanan BK (Bimbingan Konseling) belum memadai.\n\nAksesibilitas ke ruang layanan BK kurang optimal.\n\nPeralatan penunjang layanan BK kurang lengkap atau kurang terawat.\n\nRuang BK tidak memberikan kenyamanan dan privasi maksimal bagi mahasiswa.\n\nRencana Tindak Lanjut:\nMenambah dan memperbarui fasilitas pendukung layanan BK.\n\nMendesain ulang ruang layanan BK agar lebih nyaman dan mudah diakses.\n\nMengadakan audit rutin terhadap kelengkapan dan kondisi sarana BK.\n\nMelibatkan mahasiswa dalam feedback untuk peningkatan layanan BK.', '2025-06-03 01:34:55', '2025-06-03 01:34:55'),
(16, NULL, 3, 20, NULL, 'Faktor Penyebab\nKurangnya pelatihan berkelanjutan bagi petugas dalam menangani situasi darurat atau kebutuhan cepat pasien.\n\nJumlah petugas yang terbatas pada waktu-waktu sibuk sehingga pelayanan tidak dapat dilakukan secara responsif.\n\nProsedur pelayanan belum optimal dalam menyesuaikan prioritas kasus yang membutuhkan respons cepat.\n\nKoordinasi antar petugas kurang efektif, sehingga terjadi keterlambatan dalam pelayanan.\n\nKurangnya monitoring langsung oleh atasan terhadap kecepatan dan kesiapan petugas dalam melayani pasien.\n\nRencana Tindak Lanjut\nPelatihan dan workshop berkala mengenai manajemen waktu, pelayanan prima, dan respons cepat terhadap keluhan/kebutuhan pasien.\n\nEvaluasi dan penyesuaian jumlah petugas pada shift tertentu berdasarkan analisis beban kerja.\n\nPeningkatan sistem antrean atau triase agar pasien yang membutuhkan respons cepat dapat ditangani terlebih dahulu.\n\nPenerapan reward dan punishment bagi petugas berdasarkan kecepatan dan kualitas respon pelayanan.\n\nPengawasan berkala oleh supervisor, termasuk evaluasi mendadak untuk memastikan standar layanan dijaga.', '2025-06-03 01:51:45', '2025-06-03 01:51:45'),
(17, NULL, 3, 9, NULL, 'Faktor Penyebab\nKondisi fisik sarana prasarana belum optimal, seperti ruang tunggu yang kurang nyaman, ventilasi buruk, atau fasilitas yang sudah usang.\n\nAksesibilitas terbatas untuk penyandang disabilitas atau lansia (misalnya tidak adanya jalur landai, kursi roda, atau lift).\n\nKurangnya perawatan dan pemeliharaan berkala terhadap fasilitas kesehatan (misalnya toilet umum yang rusak atau kotor).\n\nDistribusi fasilitas tidak merata, sehingga beberapa bagian layanan terasa lebih padat atau kurang dilengkapi.\n\nKurangnya signage atau petunjuk arah yang jelas di dalam area pelayanan kesehatan.\n\nRencana Tindak Lanjut\nInventarisasi dan audit fasilitas untuk mengetahui kondisi terkini sarana prasarana dan menentukan prioritas perbaikan.\n\nPengadaan atau renovasi fasilitas secara bertahap, terutama yang menyangkut kenyamanan dan keselamatan pasien.\n\nPerbaikan aksesibilitas bagi kelompok rentan (disabilitas/lansia), termasuk penyediaan ramp, pegangan tangan, dan toilet khusus.\n\nPemasangan papan informasi dan penunjuk arah yang mudah dibaca dan dipahami oleh semua kalangan.\n\nMeningkatkan frekuensi dan standar kebersihan serta pemeliharaan, terutama pada ruang publik dan fasilitas umum.', '2025-06-03 01:53:46', '2025-06-03 01:53:46'),
(18, NULL, 3, 109, NULL, 'Faktor Penyebab\nKetersediaan fasilitas belum merata, seperti beberapa ruang kuliah, laboratorium, atau bengkel yang belum memenuhi standar atau kekurangan peralatan.\n\nKoneksi internet yang tidak stabil atau kurangnya akses terhadap jaringan di area tertentu.\n\nPerpustakaan kurang lengkap atau aksesnya terbatas baik secara fisik maupun digital.\n\nKurangnya integrasi antar fasilitas (misalnya laboratorium tidak terhubung dengan sistem pembelajaran berbasis teknologi).\n\nPemeliharaan dan pengelolaan fasilitas belum optimal, menyebabkan kerusakan atau tidak dapat digunakan maksimal.\n\nRencana Tindak Lanjut\nEvaluasi menyeluruh terhadap ketersediaan dan kondisi fasilitas, seperti ruang kuliah, lab, dan internet.\n\nPenyusunan rencana pengadaan dan peningkatan fasilitas, termasuk jaringan internet, alat laboratorium, serta sumber belajar digital.\n\nDigitalisasi layanan perpustakaan dan sistem informasi akademik untuk mendukung proses pembelajaran yang lebih modern dan fleksibel.\n\nPeningkatan koordinasi antara unit fasilitas dan unit akademik untuk memastikan fasilitas mendukung kebutuhan kurikulum.\n\nPenerapan sistem pemeliharaan rutin dan laporan kerusakan agar fasilitas selalu dalam kondisi siap pakai.\n\n', '2025-06-03 01:55:53', '2025-06-03 01:55:53'),
(19, NULL, 3, 128, NULL, 'Faktor Penyebab\nSebagian fasilitas sudah memadai, namun masih terdapat ruang untuk peningkatan kualitas dan ketersediaan alat atau sarana kerja.\n\nDistribusi fasilitas yang belum merata, sehingga beberapa unit kerja masih mengalami keterbatasan pendukung operasional.\n\nPenggunaan fasilitas belum optimal, karena kurangnya pelatihan atau sosialisasi mengenai cara pemanfaatannya.\n\nFrekuensi pemeliharaan belum terjadwal dengan baik, menyebabkan beberapa fasilitas kurang terawat meskipun secara umum masih berfungsi.\n\nRencana Tindak Lanjut\nPemantauan rutin dan inventarisasi kebutuhan fasilitas pendukung di setiap unit kerja secara berkala.\n\nPeningkatan kualitas dan pengadaan fasilitas tambahan untuk unit yang memiliki beban kerja lebih tinggi atau ruang kerja terbatas.\n\nSosialisasi penggunaan sarana penunjang secara optimal, termasuk pelatihan bagi staf dalam pemanfaatan teknologi atau peralatan baru.\n\nPembuatan sistem pelaporan kerusakan fasilitas agar bisa ditindaklanjuti cepat dan tepat oleh bagian umum/logistik.\n\nEvaluasi kepuasan berkala terhadap fasilitas kerja untuk memastikan seluruh staf merasa didukung secara optimal.\n\n', '2025-06-03 01:58:38', '2025-06-03 01:58:38'),
(20, NULL, 3, 129, NULL, 'Faktor Penyebab\nSebagian besar fasilitas poliklinik sudah tersedia dan berfungsi baik, namun masih terdapat ruang untuk peningkatan kelengkapan dan kenyamanan.\n\nPenggunaan ruang dan alat belum sepenuhnya optimal, kemungkinan karena keterbatasan SDM atau kurangnya sosialisasi fungsi peralatan.\n\nBeberapa peralatan medis atau pendukung pemeriksaan perlu pembaruan atau kalibrasi rutin agar tetap akurat dan layak pakai.\n\nAdanya antrian atau keterbatasan ruangan pada jam sibuk, yang bisa memengaruhi kenyamanan pengguna layanan.\n\nSarana penunjang kenyamanan pasien (misal AC, kursi tunggu, area privasi) mungkin belum maksimal di semua bagian.\n\nRencana Tindak Lanjut\nAudit sarana dan prasarana secara berkala, termasuk peralatan medis, meubel, dan kenyamanan ruang layanan.\n\nPengadaan atau peremajaan peralatan yang sudah usang, terutama alat-alat medis yang digunakan untuk diagnosis atau pemeriksaan rutin.\n\nOptimalisasi tata ruang dan alur pelayanan agar penggunaan fasilitas lebih efisien, terutama pada jam sibuk.\n\nPeningkatan sarana pendukung kenyamanan pasien, seperti kursi tunggu ergonomis, area khusus untuk privasi, dan fasilitas penunjang lainnya.\n\nPeningkatan pemeliharaan dan kalibrasi peralatan medis, dengan jadwal rutin agar kualitas layanan tetap terjaga.\n\n', '2025-06-03 02:00:21', '2025-06-03 02:00:21'),
(21, NULL, 3, 127, NULL, 'Faktor Penyebab\nRuang kerja secara umum sudah memenuhi standar, namun masih terdapat beberapa unit yang merasa ruangnya kurang optimal.\n\nLayout atau desain ruang belum ergonomis, menyebabkan keterbatasan dalam mendukung produktivitas kerja maksimal.\n\nKebutuhan ruang terus bertambah seiring peningkatan jumlah staf atau beban kerja, namun belum diimbangi dengan perluasan fisik.\n\nVentilasi, pencahayaan, dan kebisingan di beberapa ruang masih menjadi perhatian meskipun belum terlalu signifikan.\n\nFasilitas pendukung dalam ruang kerja, seperti rak penyimpanan, meja ergonomis, atau sekat privasi, belum tersedia secara merata.\n\nRencana Tindak Lanjut\nMelakukan evaluasi kebutuhan ruang kerja per unit untuk melihat kesesuaian antara ruang yang tersedia dengan jumlah staf dan jenis pekerjaan.\n\nMengoptimalkan desain interior ruang kerja agar lebih ergonomis dan mendukung kenyamanan serta efisiensi kerja.\n\nPengadaan perabotan kerja yang mendukung kesehatan dan kenyamanan, seperti kursi ergonomis, meja kerja yang sesuai, dan pencahayaan yang cukup.\n\nMeningkatkan ventilasi dan pengaturan suhu ruangan, termasuk pemeliharaan AC, jendela, atau penggunaan penyekat suara jika diperlukan.\n\nMerancang penambahan atau renovasi ruang kerja untuk unit dengan tingkat kebutuhan tinggi berdasarkan hasil survei internal.', '2025-06-03 02:02:41', '2025-06-03 02:02:41'),
(22, NULL, 3, 132, NULL, 'Faktor Penyebab\nSistem informasi cukup mudah digunakan, namun belum sepenuhnya intuitif bagi semua pengguna, terutama bagi pengguna baru.\n\nBeberapa fitur belum sepenuhnya memenuhi kebutuhan spesifik unit kerja, sehingga pengguna perlu mencari solusi alternatif atau manual.\n\nKurangnya pelatihan atau sosialisasi sistem terbaru, yang menyebabkan sebagian pengguna belum memanfaatkan sistem secara optimal.\n\nWaktu respon sistem atau dukungan teknis belum merata, terutama ketika ada gangguan teknis atau permintaan perubahan modul.\n\nTampilan antarmuka sistem masih dapat ditingkatkan untuk pengalaman pengguna (UX) yang lebih baik.\n\nRencana Tindak Lanjut\nMelakukan survei lanjutan atau FGD (Focus Group Discussion) untuk menggali kebutuhan pengguna terkait sistem informasi.\n\nMeningkatkan pelatihan dan pendampingan penggunaan sistem informasi secara berkala, khususnya saat ada fitur baru.\n\nMelakukan evaluasi fitur sistem informasi dan menyesuaikannya dengan kebutuhan nyata pengguna di berbagai unit.\n\nMenyiapkan dokumentasi/manual penggunaan sistem yang mudah diakses dan dipahami semua kalangan.\n\nMeningkatkan respon dukungan teknis IT, termasuk waktu penyelesaian aduan dan penyempurnaan bug.\n\nMengembangkan tampilan UI/UX agar lebih modern, ramah pengguna, dan responsif di berbagai perangkat.', '2025-06-03 02:04:36', '2025-06-03 02:04:36'),
(23, NULL, 3, 135, NULL, 'Faktor Penyebab\nInformasi terkait potongan gaji dan tukin belum disosialisasikan secara terbuka dan berkala kepada seluruh pegawai.\n\nKurangnya akses langsung ke data potongan pribadi melalui sistem informasi kepegawaian atau dashboard masing-masing pegawai.\n\nPenjelasan terkait alasan potongan tertentu masih minim atau membingungkan, terutama untuk potongan yang tidak terjadi rutin.\n\nKurangnya forum komunikasi dua arah antara pegawai dan bagian keuangan/SDM terkait komponen gaji dan tunjangan.\n\nRencana Tindak Lanjut\nMeningkatkan keterbukaan informasi melalui sistem informasi kepegawaian, dengan fitur riwayat potongan yang rinci dan mudah diakses.\n\nMenyusun dan menyebarluaskan panduan tertulis mengenai jenis-jenis potongan gaji dan tukin beserta dasar hukumnya.\n\nMenyelenggarakan sesi sosialisasi dan Q&A secara rutin (misalnya triwulanan) terkait komponen gaji, tukin, dan potongan.\n\nMembentuk helpdesk atau PIC khusus di bagian keuangan/SDM untuk menjawab pertanyaan atau klarifikasi pegawai.\n\nMelakukan audit dan evaluasi periodik atas transparansi laporan gaji dan tukin untuk memastikan akuntabilitas internal tetap terjaga.', '2025-06-03 02:06:48', '2025-06-03 02:06:48'),
(31, 4, NULL, 23, 'Perlu dilakukan peningkatan promosi dan pemahaman mahasiswa mengenai fungsi, peran, serta prosedur akses layanan BK, agar persepsi dan ekspektasi mahasiswa dapat dikelola dengan baik.', 'Tingkat kepuasan yang mencapai 68,75% menunjukkan bahwa mahasiswa secara umum menilai petugas BK memiliki kompetensi dan kemampuan profesional yang  baik dalam memberikan layanan bimbingan dan konseling. Meskipun demikian, terdapat 39,89% responden yang masih belum sepenuhnya puas (kategori cukup memuaskan dan tidak memuaskan), yang menunjukkan bahwa pelayanan belum sepenuhnya merata atau konsisten dalam kualitasnya. Proporsi mahasiswa yang menilai tidak memuaskan relatif kecil yaitu 4,26%, namun tetap menjadi indikator penting yang memerlukan perhatian, terutama untuk mengevaluasi kasus-kasus khusus atau kendala dalam interaksi layanan BK.', '2025-06-09 04:23:08', '2025-06-09 04:24:00'),
(35, 4, NULL, 20, 'Perlu dilakukan monitoring berkala terhadap pelayanan langsung melalui umpan balik cepat (quick feedback) setelah layanan diterima mahasiswa agar ekspektasi mahasiswa dapat dikelola dan dipenuhi dengan lebih baik.', 'Tingkat kepuasan sebesar 67,5% menunjukkan bahwa sebagian besar mahasiswa menilai petugas layanan kesehatan sigap, responsif, dan tanggap dalam memberikan pelayanan saat dibutuhkan. Persentase mahasiswa yang belum sepenuhnya puas (kategori tidak memuaskan dan cukup memuaskan) masih berada pada angka 42,6%, menunjukkan adanya pengalaman layanan yang belum merata dari segi kecepatan dan perhatian petugas terhadap kebutuhan mahasiswa. Penilaian tidak memuaskan yang diberikan oleh 6,3% responden mengindikasikan bahwa masih terdapat kasus-kasus tertentu di mana mahasiswa merasa tidak mendapatkan respons yang cepat atau sesuai harapan', '2025-06-09 04:36:16', '2025-06-09 04:36:36'),
(36, 4, NULL, 24, 'Disarankan dilakukan pelatihan berkala terkait etika pelayanan, komunikasi efektif, dan standar pelayanan prima, agar seluruh petugas memiliki standar perilaku dan kompetensi yang seragam. Juga mendorong adanya mekanisme umpan balik langsung dari mahasiswa setiap kali mereka menerima layanan kesehatan, untuk menjaring keluhan atau saran yang bersifat konstruktif dan segera ditindaklanjuti.', 'Tingginya persentase kepuasan (68,68%) menunjukkan bahwa mahasiswa secara umum menilai petugas layanan kesehatan memiliki kompetensi profesional dan sikap yang sopan dalam menjalankan tugasnya. Meskipun demikian, masih terdapat 38,42% responden yang belum sepenuhnya puas (kategori cukup memuaskan dan tidak memuaskan), yang menunjukkan bahwa ada beberapa pengalaman layanan yang belum konsisten dari segi etika pelayanan, keramahan, maupun penguasaan tugas teknis. Persentase mahasiswa yang menyatakan tidak memuaskan relatif rendah (3,68%), namun tetap penting untuk diperhatikan sebagai masukan bagi peningkatan mutu secara menyeluruh.', '2025-06-09 04:46:12', '2025-06-09 04:48:03'),
(38, 4, NULL, 34, 'Menyusun rencana pengadaan bertahap untuk ruang kelas yang belum memiliki fasilitas media pembelajaran. Dan untuk ruang kelas yang sudah tersedia fasilitas media pembelajaran, sebaiknya dilakukan pemeliharaan rutin berkala agar alat tetap dalam kondisi optimal. ', 'Tingkat kepuasan sebesar 56,25% menunjukkan bahwa fasilitas media pembelajaran di kelas belum sepenuhnya mendukung proses pembelajaran secara optimal, baik dari segi ketersediaan, kualitas fungsi alat, maupun kemudahan penggunaannya', '2025-06-09 05:01:07', '2025-06-09 05:14:33'),
(44, 2, NULL, 34, 'Solusi yang dapat dilakukan adalah melengkapi seluruh ruang kelas dengan LCD proyektor permanen, layar proyeksi, dan kabel HDMI yang panjang dan fleksibel. Selain itu, perlu dilakukan penambahan stop kontak di setiap kelas serta perawatan rutin terhadap AC dan fasilitas pendukung lainnya. Perbaikan handle pintu juga harus segera dilakukan untuk menjaga kenyamanan dan keamanan selama proses pembelajaran berlangsung.', 'Berdasarkan hasil survei dari dosen, ditemukan sejumlah kendala pada aspek tangibles (fasilitas fisik) di ruang kelas yang berpotensi mengganggu efektivitas pembelajaran. Tidak semua ruang kelas dilengkapi LCD proyektor secara permanen, sehingga dosen dan mahasiswa harus meminjam perangkat ke jurusan yang menyebabkan keterlambatan perkuliahan. Di kelas yang telah terpasang LCD, kabel HDMI yang tersedia terlalu pendek, membatasi fleksibilitas penggunaan laptop saat presentasi. Selain itu, beberapa ruang kelas belum memiliki layar LCD (screen), sehingga proyeksi dilakukan ke papan tulis atau dinding yang mengakibatkan tampilan terpotong dan kurang jelas. Jumlah stop kontak di kelas juga terbatas, menyulitkan pengisian daya perangkat elektronik. Unit AC yang tersedia tidak memberikan pendinginan optimal, menurunkan kenyamanan belajar, terutama saat suhu ruang meningkat. Ditambah lagi, beberapa handle pintu kelas mengalami kerusakan, yang tidak hanya mengganggu kenyamanan tetapi juga berdampak pada aspek keamanan ruang kelas.', '2025-06-09 08:34:30', '2025-06-09 09:45:30'),
(45, 2, NULL, 39, 'Solusi yang dapat dilakukan adalah menyediakan ruang layanan kesehatan sederhana di tingkat fakultas atau jurusan sebagai unit pertolongan pertama sebelum dirujuk ke poliklinik universitas. Ruang ini dapat dilengkapi dengan perlengkapan medis dasar dan petugas kesehatan terlatih secara bergilir. Selain itu, perlu dibangun sistem rujukan dan koordinasi yang jelas dengan poliklinik pusat agar pelayanan tetap terintegrasi dan responsif.', 'Tidak ada poliklinik di Tingkat Fakultas maupun Jurusan', '2025-06-09 08:36:11', '2025-06-09 09:46:14'),
(46, 2, NULL, 47, 'skala Proporsional Remunerasi Berbasis Capaian Kinerja (Performance-Based Remuneration Scale)', 'Pertama, pencairan remunerasi tidak memiliki kepastian waktu yang jelas, sehingga dosen tidak mengetahui secara pasti kapan dana remunerasi akan diterima. Kedua, sistem pemberian remunerasi belum sepenuhnya mencerminkan capaian kinerja dosen. Idealnya, jika kinerja dosen mencapai 75%, maka remunerasi yang diterima pun sebesar 75% dari total hak yang semestinya. Namun dalam praktiknya, dosen hanya menerima remunerasi sebesar 30% apabila tidak mencapai 100% kinerja, tanpa mempertimbangkan capaian di bawahnya secara proporsional.', '2025-06-09 08:43:22', '2025-06-09 09:46:58'),
(47, 2, NULL, 48, 'Solusi yang dapat dipertahankan adalah melanjutkan praktik transparansi pemotongan gaji dan remunerasi sebagaimana yang telah berjalan saat ini. Slip gaji yang memuat rincian jenis dan besaran potongan secara jelas harus tetap diberikan secara rutin setiap bulan. Selain itu, sistem informasi kepegawaian dapat terus dikembangkan untuk memungkinkan dosen memantau riwayat potongan secara mandiri dan real time.', 'Pelaksanaan pemotongan telah berjalan secara transparan dan sesuai ketentuan yang berlaku. Informasi mengenai jenis dan besaran potongan tercantum dengan jelas dalam slip gaji yang diterima oleh dosen setiap bulannya, sehingga tidak menimbulkan kebingungan atau ketidakpastian.', '2025-06-09 08:45:38', '2025-06-09 09:47:41'),
(48, 2, NULL, 32, 'Skala Proporsional Remunerasi Berbasis Capaian Kinerja (Performance-Based Remuneration Scale)', 'Pertama, pencairan remunerasi tidak memiliki kepastian waktu yang jelas, sehingga dosen tidak mengetahui secara pasti kapan dana remunerasi akan diterima. Kedua, sistem pemberian remunerasi belum sepenuhnya mencerminkan capaian kinerja dosen. Idealnya, jika kinerja dosen mencapai 75%, maka remunerasi yang diterima pun sebesar 75% dari total hak yang semestinya. Namun dalam praktiknya, dosen hanya menerima remunerasi sebesar 30% apabila tidak mencapai 100% kinerja, tanpa mempertimbangkan capaian di bawahnya secara proporsional. Hal ini menimbulkan ketidakadilan dan berpotensi menurunkan motivasi kinerja dosen dalam jangka panjang.', '2025-06-09 08:46:33', '2025-06-09 09:44:33'),
(49, 2, NULL, 9, 'Solusi yang dapat dilakukan adalah menambah fasilitas layanan kesehatan di tingkat fakultas dan jurusan serta menempatkan petugas kesehatan atau tenaga pendukung yang terlatih. Selain itu, perlu dilakukan kerja sama dengan unit kesehatan kampus dan sosialisasi alur layanan agar akses mahasiswa lebih mudah dan cepat.', 'Berdasarkan hasil survei terhadap mahasiswa terkait kecukupan aksesibilitas dan kualitas sarana prasarana layanan kesehatan, tingkat kepuasan berada pada angka 70,97% dengan kategori puas. Meskipun demikian, tingkat kepuasan ini belum mencapai kategori sangat puas karena keterbatasan sarana dan prasarana kesehatan yang tersedia, baik di tingkat fakultas maupun jurusan. ', '2025-06-09 08:50:58', '2025-06-09 09:06:40'),
(50, 2, NULL, 15, 'Solusi yang dapat dilakukan adalah memperkuat penyediaan sarana dan prasarana layanan kesehatan di setiap fakultas dan jurusan. Penambahan ruang layanan, peralatan medis dasar, dan tenaga pendukung akan mendukung kelancaran prosedur yang sudah ada. Selain itu, perlu dilakukan pelatihan petugas serta sosialisasi prosedur layanan agar pelayanan lebih cepat dan efisien.\n', 'Hasil survei terhadap mahasiswa menunjukkan bahwa tingkat kepuasan terhadap prosedur layanan kesehatan berada pada angka 71,14% dengan kategori puas. Meskipun secara prosedural mahasiswa merasa cukup terbantu dalam mengakses layanan kesehatan, namun tingkat kepuasan ini belum mencapai kategori sangat puas. Hal ini berkaitan erat dengan temuan pada aspek tangibles sebelumnya, yakni masih minimnya sarana dan prasarana kesehatan di tingkat fakultas maupun jurusan. ', '2025-06-09 08:53:32', '2025-06-09 09:08:13'),
(51, 2, NULL, 19, 'Solusi yang dapat dilakukan adalah menyediakan petugas Bimbingan Konseling (BK) profesional di tingkat fakultas atau jurusan untuk mendampingi mahasiswa secara lebih optimal. Layanan konseling perlu dilengkapi dengan ruang khusus dan sistem penjadwalan yang terstruktur. Selain itu, pelatihan dasar konseling bagi kaprodi atau dosen pembimbing akademik juga dapat menjadi langkah pendukung sementara.', 'Berdasarkan hasil survei mahasiswa, tingkat kepuasan terhadap ketanggapan petugas Bimbingan Konseling (BK) dalam membantu dan memberikan layanan tercatat sebesar 72,38% dengan kategori puas. Meskipun respon terhadap kebutuhan konseling tergolong cukup baik, pelayanan BK di tingkat fakultas atau jurusan masih terbilang minim. Hingga saat ini, peran pelayanan konseling sebagian besar masih ditangani oleh ketua program studi (kaprodi), bukan oleh petugas khusus atau profesional di bidang BK. Hal ini menunjukkan bahwa meskipun mahasiswa merasa cukup tertolong, layanan belum ditangani oleh tenaga konseling yang kompeten secara khusus, sehingga potensi pengembangan layanan BK yang lebih efektif dan profesional masih terbuka lebar untuk ditingkatkan demi mendukung kesejahteraan psikologis dan akademik mahasiswa.', '2025-06-09 08:57:05', '2025-06-09 09:09:50'),
(52, 2, NULL, 20, 'Solusi yang dapat dilakukan adalah menambah jumlah petugas layanan kesehatan di tingkat fakultas dan jurusan untuk memastikan respons cepat dalam situasi mendesak. Penempatan petugas secara bergilir atau sistem piket juga bisa diterapkan untuk menjangkau seluruh unit secara merata. Selain itu, perlu disiapkan prosedur darurat yang jelas dan terintegrasi dengan unit kesehatan kampus.\n', 'Hasil survei mahasiswa menunjukkan bahwa tingkat kepuasan terhadap kesigapan petugas layanan kesehatan berada pada angka 72,78% dengan kategori puas. Meskipun secara umum mahasiswa merasakan adanya respons yang cukup baik dari petugas layanan kesehatan, namun ketersediaan petugas tersebut masih tergolong minim, terutama di tingkat fakultas dan jurusan. Kondisi ini menyebabkan pelayanan kesehatan belum dapat diberikan secara optimal, terutama dalam situasi mendesak atau ketika diperlukan penanganan cepat. Keterbatasan jumlah petugas kesehatan menjadi tantangan utama yang perlu segera ditindaklanjuti agar layanan kesehatan dapat berjalan lebih responsif dan memenuhi harapan mahasiswa secara menyeluruh.', '2025-06-09 08:59:04', '2025-06-09 09:10:56'),
(53, 2, NULL, 8, 'Solusi yang dapat dilakukan adalah menyediakan ruang khusus untuk layanan Bimbingan Konseling (BK) di setiap fakultas atau jurusan dengan memperhatikan aspek privasi. Dilengkapi pula dengan fasilitas pendukung seperti alat dokumentasi dan administrasi layanan yang memadai. Hal ini akan meningkatkan kenyamanan dan efektivitas layanan konseling bagi mahasiswa secara profesional.\n', 'Hasil survei terhadap mahasiswa menunjukkan bahwa tingkat kepuasan terhadap kecukupan aksesibilitas dan kualitas sarana prasarana layanan Bimbingan Konseling (BK) berada pada angka 72,98% dengan kategori puas. Meskipun demikian, sarana dan prasarana layanan BK di lingkungan fakultas maupun jurusan masih tergolong minim. Ketiadaan ruang konseling khusus, kurangnya privasi dalam pelaksanaan layanan, serta belum tersedianya fasilitas pendukung seperti peralatan dokumentasi atau administrasi layanan menjadi kendala dalam optimalisasi fungsi BK. Kondisi ini menunjukkan perlunya penguatan dukungan infrastruktur agar layanan BK dapat diakses mahasiswa dengan lebih nyaman, profesional, dan sesuai standar layanan konseling pendidikan tinggi.', '2025-06-09 09:00:37', '2025-06-09 09:11:48'),
(55, 4, NULL, 39, 'Temuan ini mengindikasikan adanya potensi peningkatan kepuasan apabila sarana dan prasarana layanan kesehatan diperluas atau ditingkatkan aksesibilitasnya bagi sivitas akademika di tingkat fakultas atau jurusan, baik melalui pembentukan unit layanan kesehatan skala kecil maupun kerja sama layanan dengan pihak internal universitas.', 'Tidak ada responden yang menyatakan ketidakpuasan, dan seluruh responden memberikan penilaian positif, meskipun dalam tiga tingkat yang berbeda (cukup memuaskan, memuaskan, sangat memuaskan). Hal ini mencerminkan bahwa ketersediaan dan kelengkapan sarana dan prasarana poliklinik yang disediakan di tingkat universitas sudah cukup mendukung kebutuhan kesehatan dasar dosen, walaupun akses layanan tersebut belum tersedia secara langsung di tingkat fakultas, jurusan, maupun UPPS.', '2025-06-09 10:23:18', '2025-06-09 10:26:25'),
(56, 4, NULL, 9, 'Penyebarluasan informasi layanan kesehatan secara lebih intensif agar mahasiswa mengetahui jenis layanan yang tersedia dan bagaimana mengaksesnya. Penguatan koordinasi antara unit layanan kesehatan universitas dengan fakultas dan jurusan dalam hal sosialisasi dan penjangkauan layanan. Penyediaan unit layanan kesehatan pendukung di fakultas atau jurusan, atau minimal adanya petugas penghubung untuk mempercepat akses informasi dan rujukan. Selanjutnya perlu dilakukan identifikasi lebih lanjut terhadap faktor-faktor yang menyebabkan 7,37% responden menyatakan tidak memuaskan, misalnya melalui wawancara mendalam atau survei kualitatif tambahan.', 'Tingkat kepuasan 66,84% yang berada pada kategori mutu layanan Baik dengan predikat Puas menunjukkan bahwa secara umum, mahasiswa menilai bahwa layanan kesehatan yang tersedia cukup memadai, baik dari segi aksesibilitas maupun kualitas sarana prasarana layanan kesehatan. Namun, masih terdapat 42,63% responden (kategori tidak memuaskan dan cukup memuaskan) yang belum sepenuhnya puas, yang mengindikasikan bahwa ada ruang perbaikan khususnya dalam hal aksesibilitas layanan. Saat ini layanan kesehatan hanya tersedia di tingkat universitas dan belum tersedia di tingkat fakultas, jurusan, maupun UPPS. Hal ini menyebabkan keterbatasan akses langsung dan cepat terhadap layanan kesehatan bagi mahasiswa Program Studi Pendidikan Matematika yang berlokasi di luar area pusat layanan kampus. erdapat 7,37% responden yang menyatakan tidak memuaskan, relatif kecil namun tetap perlu menjadi perhatian, karena dapat berpengaruh terhadap persepsi umum dan kredibilitas pelayanan kampus di bidang kesehatan.', '2025-06-09 10:54:40', '2025-06-09 10:57:06'),
(57, 4, NULL, 15, 'Diperlukan peningkatan sosialisasi kepada mahasiswa mengenai prosedur layanan kesehatan yang berlaku, termasuk mekanisme pengaduan atau umpan balik jika terdapat kendala layanan.', 'Tingkat kepuasan sebesar 66,45% menunjukkan bahwa mayoritas mahasiswa merasa bahwa prosedur layanan kesehatan di kampus berjalan dengan baik, baik dari segi kejelasan alur layanan, konsistensi pelaksanaan, maupun keandalan dalam merespons kebutuhan mahasiswa. Namun, terdapat 44,21% responden yang belum sepenuhnya puas (gabungan dari kategori tidak memuaskan dan cukup memuaskan), yang menandakan bahwa masih terdapat beberapa kendala atau hambatan dalam implementasi prosedur layanan kesehatan. Layanan kesehatan saat ini hanya tersedia di tingkat universitas dan belum tersedia di tingkat fakultas, jurusan, maupun Unit Pengelola Program Studi (UPPS). Ketidakhadiran layanan di tingkat lebih dekat dengan mahasiswa berpotensi memengaruhi persepsi kepuasan sebagian mahasiswa. Terdapat 7,37% responden yang memberikan penilaian tidak memuaskan, relatif kecil namun perlu mendapat perhatian khusus sebagai indikasi awal adanya pengalaman negatif atau ketidaksesuaian prosedur di lapangan.', '2025-06-09 11:30:35', '2025-06-09 11:33:13'),
(58, 4, NULL, 33, 'Memastikan mutu ruang kelas semakin merata dan mendukung proses pembelajaran secara optimal.', 'Tingginya persentase kepuasan yaitu 68,75% dengan predikat puas, sehingga kinerja unit pelayanan dinyatakan baik. Temuan ini menunjukkan bahwa sebagian besar (75%) dosen telah menilai ruang kelas dalam kondisi memadai (memuaskan dan sangat memuaskan), namun masih terdapat 25% yang menyatakan ketidakpuasan terhadap kondisi ruang kelas. Kemungkinan permasalahan dapat berkaitan dengan fasilitas dalam ruang kelas yang belum merata mutunya.', '2025-06-10 01:43:34', '2025-06-10 01:46:01'),
(59, 4, NULL, 35, 'Meningkatkan sarana dan prasarana penunjang baik secara kuantitas maupun kualitas, agar mampu memenuhi ekspektasi dosen secara lebih menyeluruh.', 'Tidak ada responden yang menyatakan ketidakpuasan, dan seluruh responden memberikan penilaian positif, meskipun dalam tiga tingkat yang berbeda (cukup memuaskan, memuaskan, sangat memuaskan). Hal ini mencerminkan bahwa sarana dan prasarana di ruang praktek/laboratorium/dsb sudah cukup lengkap.  ', '2025-06-10 02:01:29', '2025-06-10 03:54:27'),
(63, 11, NULL, 41, NULL, 'Hasil survei menunjukkan bahwa tingkat kepuasan dosen terhadap fasilitas tempat parkir tergolong rendah. Meskipun secara fisik tersedia area parkir di lingkungan kampus, kenyamanan dan efektivitas penggunaannya belum optimal. Beberapa akar masalah yang teridentifikasi adalah:\n1. Area Parkir Dosen dan Mahasiswa tidak dipisah\nTidak adanya zona parkir khusus dosen menyebabkan dosen harus bersaing dengan mahasiswa dalam memanfaatkan lahan parkir yang tersedia. Pada jam-jam sibuk, area parkir sering penuh terlebih dahulu oleh kendaraan mahasiswa, sehingga dosen kesulitan mendapatkan tempat.\n\n2. Kenyamanan Tempat Parkir yang Kurang\nArea parkir yang tersedia tidak dilengkapi dengan penanda atau zonasi jelas, tidak memiliki atap pelindung dari panas dan hujan, serta kondisi permukaan parkir yang tidak rata atau berlubang menambah ketidaknyamanan pengguna.\n\n3. Kurangnya Pengelolaan dan Pengawasan\nTidak adanya pengaturan dan pengawasan rutin di area parkir membuat penggunaan lahan parkir menjadi tidak efisien. Beberapa kendaraan diparkir sembarangan, menambah kemacetan dan mengurangi kapasitas efektif.\n\nRekomendasi Perbaikan\nUntuk UPPS (Unit Pengelola Program Studi):\n1. Membuat Zonasi Khusus Parkir Dosen\nMengusulkan kepada pihak universitas untuk menyiapkan zona eksklusif parkir dosen dengan akses terbatas, menggunakan tanda khusus atau akses kontrol (misalnya ID Card dosen).\n\n2. Meningkatkan Kualitas Fasilitas Parkir\nMelakukan perbaikan fasilitas tempat parkir melalui pengadaan atap pelindung, penambahan penerangan, perbaikan permukaan lahan parkir, serta pemasangan rambu/rambu horizontal (marka lantai) untuk mengatur posisi kendaraan.\n\n3. Koordinasi dengan Satpam atau Tim Keamanan Kampus\nMemaksimalkan fungsi petugas parkir atau sistem pengawasan pada jam-jam sibuk guna memastikan keteraturan dan efisiensi penggunaan area parkir.\n\nUntuk Program Studi (PS):\n1. Melakukan Survei Lanjutan dan Monitoring Berkala\nMengadakan survei tahunan untuk memantau peningkatan kepuasan dosen setelah implementasi kebijakan baru serta menjaring masukan untuk perbaikan lebih lanjut.\n\n2. Mengedukasi Mahasiswa tentang Tata Tertib Parkir\nMemberikan sosialisasi mengenai etika parkir dan pentingnya memberikan prioritas kepada tenaga pendidik melalui papan informasi atau pengumuman rutin.\n\n3. Kolaborasi untuk Penyusunan Rencana Anggaran\nBersama UPPS, menyusun rencana kerja dan anggaran khusus perbaikan fasilitas fisik termasuk parkir, untuk diajukan dalam Rencana Strategis (Renstra) atau evaluasi mutu tahunan.', '2025-06-10 04:24:11', '2025-06-10 04:24:11'),
(69, 12, NULL, 47, ' perlu adanya perbaikan dalam sistem pemberian insentif dan remunerasi dengan memastikan bahwa pembayaran dilakukan tepat waktu sesuai dengan jadwal yang telah ditentukan. Transparansi mengenai proses pencairan juga harus diperjelas agar penerima insentif memahami prosedur dan waktu yang diharapkan. Selain itu, komunikasi yang lebih baik antara manajemen dan penerima insentif mengenai tanggal pencairan dan alasan keterlambatan jika terjadi dapat mengurangi ketidakpuasan. Dengan perbaikan ini, diharapkan kepuasan terhadap sistem insentif dan remunerasi dapat meningkat, serta motivasi karyawan atau penerima insentif tetap terjaga', 'Hasil survei menunjukkan tingkat kepuasan 68.18%, yang menandakan bahwa beberapa responden merasa bahwa pemberian insentif dan remunerasi tidak selalu sesuai jadwal yang seharusnya. Ketidakpuasan ini mungkin berkaitan dengan ketidakjelasan waktu pencairan.', '2025-06-10 04:43:43', '2025-06-12 03:55:02'),
(71, 11, NULL, 39, NULL, 'Tingkat kepuasan dosen terhadap ketersediaan sarana dan prasarana poliklinik tercatat rendah berdasarkan hasil survei. Setelah ditelusuri, akar permasalahan yang memengaruhi penilaian tersebut antara lain:\n\n1. Tidak Tersedianya Poliklinik di Kampus 4\nSaat ini, Kampus 4 Universitas Negeri Gorontalo tidak memiliki fasilitas poliklinik tersendiri. Hal ini menjadi kendala signifikan bagi dosen maupun tenaga kependidikan yang membutuhkan layanan kesehatan ringan, pemeriksaan awal, atau penanganan medis darurat di lokasi kampus.\n\n2. Lokasi Poliklinik Masih Terpusat di Kampus 1 UNG\nLayanan kesehatan kampus hanya tersedia di Kampus 1 yang berjarak cukup jauh dari Kampus 4. Ini menyulitkan akses, khususnya dalam kondisi darurat atau untuk keperluan medis harian. Ketergantungan terhadap fasilitas yang hanya ada di satu lokasi menimbulkan persepsi ketidakmerataan pelayanan antar kampus.\n\n3. Ketiadaan Informasi dan Rujukan\nMinimnya informasi atau prosedur rujukan dari Kampus 4 ke Poliklinik Kampus 1 juga menjadi hambatan. Tidak ada sistem yang secara eksplisit memfasilitasi rujukan cepat atau dukungan logistik untuk dosen dan staf yang membutuhkan akses ke poliklinik tersebut.\n\nRekomendasi Perbaikan\nUntuk UPPS (Unit Pengelola Program Studi):\n1. Mengusulkan Pendirian Poliklinik Satelit di Kampus 4\nMengajukan usulan pembangunan poliklinik kepada pihak rektorat/universitas sebagai bentuk desentralisasi layanan kesehatan. Fasilitas awal dapat berupa ruang periksa, layanan obat ringan, dan tenaga medis minimal (perawat atau dokter jaga paruh waktu).\n\n2. Menyusun Kajian Kebutuhan Layanan Kesehatan\nMembuat kajian kebutuhan (need assessment) terkait urgensi dan frekuensi layanan kesehatan bagi civitas akademika di Kampus 4 sebagai bahan pendukung proposal pengembangan fasilitas.\n\n3. Advokasi Penguatan Layanan Kesehatan Terintegrasi\nMenyampaikan kebutuhan ini dalam forum strategis seperti rapat senat fakultas, evaluasi mutu internal, atau pertemuan lintas unit universitas untuk mendapatkan dukungan pengambil kebijakan.\n\nUntuk Program Studi (PS):\n1. Pemetaan dan Sosialisasi Akses Layanan Kesehatan Terdekat\nMelakukan identifikasi fasilitas kesehatan terdekat dari Kampus 4 (Puskesmas, klinik swasta, apotek) dan menyebarkan informasi tersebut kepada dosen dan mahasiswa melalui media informasi kampus.\n\n2. Penyusunan Prosedur Penanganan Medis Darurat\nMenyusun dan mensosialisasikan SOP (Standard Operating Procedure) sederhana terkait penanganan medis darurat di Kampus 4, termasuk prosedur evakuasi atau transportasi ke Kampus 1 bila diperlukan.\n\n3. Penguatan Kemitraan dengan Layanan Kesehatan Lokal\nBekerja sama dengan instansi kesehatan setempat (puskesmas/klinik) untuk menyediakan layanan konsultasi atau pemeriksaan rutin di kampus dalam skema berkala, misalnya pemeriksaan tekanan darah, gula darah, atau layanan imunisasi.', '2025-06-10 04:57:37', '2025-06-10 04:57:37'),
(76, 10, NULL, 49, 'Tindak lanjut dari universitas yakni mempertahankan performa yang sudah dicapai pada pencairan remunerasi..', 'Ketepatan pencairan gaji dan sertifikasi dosen sudah baik karena pembiayaan langsung dari kementerian, namun pencairan remunerasi kurang memuaskan bagi dosen dikarenakan ketidakjelasan waktu pencairannya. Solusi yang disarankan adalah sebaiknya pemangku kebijakan membuat aturan yang menjamin waktu pencairan remunerasi sehingga kesejahteraan dosen bisa tercapai', '2025-06-10 05:10:10', '2025-06-10 06:09:00'),
(78, 10, NULL, 35, 'Untuk meningkatkan tingkat kepuasan, langkah yang dapat diambil adalah melakukan audit sarana dan prasarana secara berkala untuk memastikan bahwa fasilitas di ruang praktek dan laboratorium dalam kondisi baik dan lengkap. Perawatan rutin dan penggantian alat yang sudah rusak perlu dilakukan. Selain itu, pihak terkait harus memastikan adanya fasilitas pendukung yang memadai dan memperhatikan kebersihan serta kenyamanan ruang praktek.\n\n', 'Adanya beberapa peralatan masih mengalami kerusakan dan membutuhkan perbaikan atau penggantian dan terdapatnya kekurangan dalam jumlah peralatan tertentu yang sering digunakan dalam praktikum ; serta beberapa dosen mengeluhkan suhu ruangan labratorium Fisika yang tidak kondusif (panas). Solusi yang disarankan adalah memperbaharui peralatan laboratorium Fisika dan menambah kuantitasnya serta memperbaiki pengatur suhu ruangan di laboratorium Fisika sehingga tercipta suasana akademik yang baik', '2025-06-10 05:14:32', '2025-06-10 05:41:55'),
(79, 11, NULL, 51, 'Diadakannya forum diskusi dosen per jurusan.', 'Nilai kepuasan dosen terhadap aspek keterlibatan dalam penyusunan RBA masih tergolong rendah. Hal ini mencerminkan persepsi dosen yang merasa kurang dilibatkan secara langsung dalam proses pengambilan keputusan terkait alokasi dan perencanaan anggaran. Beberapa akar masalah yang menyebabkan rendahnya persepsi ini adalah:\n1. Tidak Ada Keterlibatan Langsung Dosen dalam Proses Penyusunan RBA\nDalam praktiknya, penyusunan RBA dilakukan secara terpusat oleh pimpinan unit (UPPS) bersama Ketua Jurusan atau Ketua Program Studi. Sementara itu, dosen hanya menerima informasi akhir tanpa ruang eksplisit untuk memberikan masukan langsung terhadap kebutuhan atau prioritas program.\n\n2. Minimnya Komunikasi dan Transparansi Tahapan Penyusunan RBA\nTidak semua dosen mengetahui tahapan penyusunan RBA, prinsip-prinsip dasar pengalokasian anggaran, dan mekanisme penjaringan aspirasi. Hal ini memperkuat persepsi bahwa penyusunan RBA bersifat top-down tanpa partisipasi dosen.\n\n3. Ketidakterbukaan Akses terhadap Dokumen RBA\nDokumen RBA umumnya tidak dibuka secara luas atau dijelaskan kembali kepada seluruh dosen, sehingga banyak dosen tidak mengetahui apakah kebutuhan mereka sudah diakomodasi atau tidak.\n\nRekomendasi Perbaikan\nUntuk UPPS (Unit Pengelola Program Studi):\n1. Membangun Mekanisme Formal Penjaringan Aspirasi Dosen\nMenyusun sistem penjaringan kebutuhan dan aspirasi dosen secara tertulis menjelang penyusunan RBA, seperti melalui kuesioner, form usulan kegiatan, atau forum diskusi dosen per jurusan.\n\n2. Transparansi dalam Proses dan Hasil Penyusunan RBA\nMenyediakan ruang informasi terkait rencana dan hasil RBA (secara garis besar) kepada seluruh dosen melalui media internal.\n\n3. Meningkatkan Pelatihan dan Pemahaman Dosen tentang Manajemen Anggaran\nMenyelenggarakan workshop atau sosialisasi tentang prinsip dan kerangka penyusunan RBA agar dosen memahami batasan dan peluang dalam proses perencanaan anggaran.\n\nUntuk Program Studi (PS):\n1. Mengadakan Forum Curah Pendapat Pra-RBA\nMenjadwalkan pertemuan dosen secara berkala untuk menginventarisasi kebutuhan program studi, bahan ajar, laboratorium, dan program pengabdian yang memerlukan dukungan anggaran, untuk selanjutnya dibawa Ketua Prodi ke forum UPPS.\n\n2. Menerapkan Prinsip Bottom-Up Secara Parsial\nMeskipun pengambilan keputusan tetap dilakukan oleh pimpinan, namun program studi dapat menerapkan prinsip partisipatif dengan mengintegrasikan usulan prioritas dari dosen dalam proposal RBA yang diajukan.\n\n3. Evaluasi dan Refleksi Pasca-Pengajuan RBA\nSetelah proses RBA selesai, program studi mengadakan pertemuan untuk merefleksikan sejauh mana usulan dosen diakomodasi, serta membangun komitmen bersama untuk tindak lanjut di tahun anggaran berikutnya.', '2025-06-10 05:15:03', '2025-06-10 06:12:39'),
(82, 10, NULL, 41, NULL, 'UPPS telah menyediakan tempat parkir motor dan mobil, akan tetapi terdapat beberapa area parkir untuk motor yang mengalami kerusakan pada permukaan jalan (lubang dan genangan air) yang dapat mengganggu kenyamanan kendaraan bermotor dan ketersediaan tempat parkir mobil yang semakin terbatas dapat menyebabkan kesulitan mencari tempat parkir khusus area mobil serta kondisi tempat parkir mobil yang perlu diperbaiki supaya diberi semua kanopi. Solusi yang disarankan adalah memperbaiki sarana dan prasarana tempat parkir, baik untuk motor maupun mobil sehingga tercipta kenyamanan penggunanya', '2025-06-10 05:24:33', '2025-06-10 05:24:33'),
(84, 10, NULL, 34, 'Untuk meningkatkan kepuasan, disarankan agar pihak terkait melakukan pemeriksaan dan perawatan rutin pada fasilitas media pembelajaran, termasuk memastikan bahwa semua perangkat berfungsi dengan baik sebelum digunakan. Selain itu, memberikan pelatihan kepada pengajar dan mahasiswa tentang penggunaan alat-alat tersebut akan membantu meminimalkan kesalahan penggunaan. Mengganti atau memperbarui perangkat yang sudah usang juga dapat menjadi solusi jangka panjang.', 'UPPS telah menyediakan fasilitas media pembelajaran dengan baik, namun masih terdapat beberapa perangkat LCD yang ada tidak berfungsi dengan baik, seperti LCD yang kadang mengalami masalah dengan resolusi gambar, kabel yang sering terlepas atau tidak kompatibel dengan perangkat laptop. Solusi yang ditawarkan adalah beberapa dosen mengusulkan untuk perbaikan perangkat tersebut yang mendukung pengalaman belajar yang lebih interaktif dan efisien di dalam kelas', '2025-06-10 05:27:45', '2025-06-10 05:32:25'),
(86, 10, NULL, 39, NULL, 'Tidak ditemukannya poliklinik baik di tingkat UPPS maupun di tingkat Jurusan Fisika, sehingga tidak ada temuan untuk kelengkapan sarana dan prasarananya. Solusi yang disarankan adalah perlu Poliklinik di tingkat UPPS sehingga mahasiswa mendapat pelayanan kesehatan dengan cepat dan baik', '2025-06-10 05:30:12', '2025-06-10 05:30:12'),
(87, 11, NULL, 63, NULL, 'Hasil survei menunjukkan bahwa tingkat kepuasan dosen terhadap kemudahan dalam menggunakan fasilitas penelitian masih rendah, terutama dalam lingkup Program Studi Pendidikan IPA. Permasalahan ini mengindikasikan adanya hambatan struktural dan teknis yang dirasakan dosen saat melakukan aktivitas riset. Beberapa akar permasalahan yang diidentifikasi adalah:\n1.	Keterbatasan Akses terhadap Laboratorium dan Peralatan Penelitian\nMeskipun tersedia laboratorium, namun akses penggunaannya belum optimal, baik dari sisi waktu penggunaan, kelengkapan alat, maupun kualitas peralatan yang tersedia.\n2.	Prosedur Administratif yang Rumit\nProsedur peminjaman alat, bahan, dan ruangan laboratorium dianggap terlalu birokratis, dengan banyaknya tahapan persetujuan dan dokumen yang harus dipenuhi, sehingga menghambat fleksibilitas penelitian.\n\nRekomendasi Perbaikan\nUntuk UPPS (Unit Pengelola Program Studi):\n1.	Revitalisasi dan Penataan Fasilitas Penelitian\nMengusulkan peningkatan kapasitas laboratorium riset, baik dari segi alat, bahan, maupun perangkat pendukung berbasis digital, serta memastikan ketersediaan ruang khusus untuk penelitian dosen yang terpisah dari laboratorium pembelajaran rutin.\n\n2.	Penyederhanaan Prosedur Akses Fasilitas\nMenyusun SOP yang lebih ringkas dan efisien untuk penggunaan laboratorium dan fasilitas riset, termasuk pengelolaan jadwal daring, formulir digital, dan sistem monitoring berbasis aplikasi atau platform intranet kampus.\n\n3.	Peningkatan Dana Operasional Penelitian\nMengalokasikan dana fakultas atau mengadvokasi kepada universitas untuk menyediakan anggaran tambahan khusus bahan habis pakai dan alat bantu sederhana, agar dosen tidak lagi terbebani pembelian pribadi.\n\nUntuk Program Studi (PS):\n1.	Pemetaan Kebutuhan Riset Tahunan\nMenginisiasi pemetaan kebutuhan fasilitas penelitian dosen setiap awal tahun akademik sebagai dasar penyusunan anggaran dan pelaksanaan kegiatan penelitian terstruktur berbasis roadmap program studi.\n\n2.	Evaluasi dan Umpan Balik Penggunaan Laboratorium\nMembuat sistem umpan balik (feedback form) dari pengguna laboratorium untuk menilai efektivitas layanan, kekurangan sarana, dan usulan perbaikan berkala yang ditindaklanjuti secara konkret oleh program studi.\n', '2025-06-10 05:36:04', '2025-06-10 05:36:04'),
(88, 10, NULL, 9, NULL, 'Fasilitas kesehatan yang tersedia hanya di tingkat universitas yang sudah dilengkapi dengan infrastruktur yang memadai. Namun, masih ditemukan akses yang agak jauh baik dari segi jarak maupun segi transportasi sehingga menurunkan tingkat aksesibilitas bagi mahasiswa Jurusan Fisika yang membutuhkan layanan kesehatan. Dengan demikian, solusi yang ditawarkan adalah membuat fasilitas kesehatan di tingkat UPPS atau di daerah kampus 4 sehingga mahasiswa memperoleh layanan kesehatan secara mudah dan cepat', '2025-06-10 05:41:47', '2025-06-10 05:41:47'),
(90, 10, NULL, 15, NULL, 'Terdapat fasilitas kesehatan universitas yang sudah memiliki SOP yang jelas, namun masih ada beberapa yang belum sepenuhnya memperbarui SOP mereka sesuai dengan perkembangan terkini dalam dunia medis. Ketidaksesuaian antara SOP yang ada dengan praktik di lapangan sering kali menyebabkan ketidakefektifan dalam pelaksanaan prosedur dan dapat mempengaruhi hasil layanan kesehatan. Dengan demikian, solusi yang ditawarkan adalah memperbarui SOP untuk layanan kesehatan sehingga tercipta layanan kesehatan yang efektif dan efisien', '2025-06-10 05:44:23', '2025-06-10 05:44:23');
INSERT INTO `temuans` (`id`, `prodi_id`, `fakultas_id`, `indikator_id`, `solusi`, `temuan`, `created_at`, `updated_at`) VALUES
(91, 11, NULL, 75, NULL, 'Hasil survei menunjukkan bahwa aspek kemudahan mendapatkan bimbingan dalam mencapai output penelitian masih belum memuaskan. Dosen merasa belum memperoleh dukungan yang memadai secara sistemik untuk menuntun mereka dari tahap pelaksanaan penelitian hingga pencapaian output yang diharapkan seperti publikasi ilmiah, paten, atau luaran inovatif lainnya. Akar permasalahan yang teridentifikasi meliputi:\n1.	Minimnya Pendampingan Pasca-Pendanaan\nBimbingan atau pendampingan yang diberikan kepada dosen lebih banyak terfokus pada tahap awal, seperti pelatihan penyusunan proposal hibah penelitian. Namun, setelah pendanaan diperoleh, tidak ada tindak lanjut berupa pendampingan teknis untuk penyusunan artikel ilmiah, strategi publikasi di jurnal terakreditasi, atau pengurusan HKI/paten.\n2.	Ketiadaan Program Pembimbingan Terstruktur\nTidak ada sistem mentoring atau coaching terstruktur yang mendampingi dosen, khususnya dosen muda, dalam memetakan dan mengeksekusi output penelitian. Banyak dosen bekerja sendiri tanpa arahan, sehingga berisiko gagal mencapai luaran sesuai target kinerja institusi.\n3.	Kurangnya Pelatihan Output Berbasis Target Spesifik\nPelatihan yang ada cenderung bersifat umum dan belum mengakomodasi ragam kebutuhan dosen, seperti teknik penulisan artikel Q1/Q2, manajemen referensi, publikasi buku ber-ISBN, penyusunan paten sederhana, atau proses pengajuan jurnal internasional bereputasi.\n\nRekomendasi Perbaikan\nUntuk UPPS (Unit Pengelola Program Studi):\n1.	Menyusun Program Bimbingan Output Terintegrasi\nMerancang program pendampingan riset terpadu yang mencakup tahapan pasca-hibah: mulai dari penulisan hasil penelitian, seleksi jurnal tujuan, strategi publikasi, sampai pendampingan submit artikel. Program ini bisa dilakukan dalam bentuk coaching clinic, research output camp, atau one-on-one mentoring.\n2.	Menghadirkan Narasumber dan Reviewer Profesional\nMengundang peneliti senior, reviewer jurnal nasional dan internasional, atau pemegang paten untuk memberikan bimbingan teknis spesifik dan praktis kepada dosen dalam sesi-sesi pelatihan lanjutan.\n3.	Menyediakan Platform Monitoring Output Penelitian\nMembangun sistem daring berbasis dashboard atau lembar monitoring progres output penelitian dosen yang terintegrasi dengan SISTER, SIMLITABMAS, atau sistem internal universitas sebagai alat kontrol dan umpan balik.\n\nUntuk Program Studi (PS):\n1.	Membentuk Tim Pendamping Output Penelitian\nMembentuk gugus atau tim pendamping output riset di tingkat program studi, yang bertugas mengawal dosen dalam proses penulisan dan publikasi, serta menjadi penghubung ke narasumber atau reviewer ahli.\n2.	Mendorong Kolaborasi Riset Internal\nMeningkatkan kolaborasi antardosen dalam tim riset lintas topik atau lintas rumpun keilmuan, agar terjadi pertukaran pengalaman dalam menulis dan menyusun luaran riset secara kolektif.\n3.	Membangun Kalender Akademik Output Riset\nMenyusun kalender tahunan yang mencantumkan waktu pendampingan output, jadwal submit artikel, workshop, dan tenggat-tenggat penting agar dosen dapat merencanakan kegiatan penelitian hingga output secara terstruktur.', '2025-06-10 05:44:57', '2025-06-10 05:44:57'),
(93, 10, NULL, 20, NULL, 'Petugas yang peduli dan empatik dapat memberikan rasa aman dan nyaman bagi mahasiswa. Namun, masih ditemukan beberapa petugas yang kurang menunjukkan empati, baik karena kelelahan, kurangnya pelatihan, atau ketidaksesuaian dengan prosedur pelayanan. Hal ini dapat menurunkan tingkat kepuasan mahasiswa jurusan fisika meskipun pelayanan medis diberikan dengan cepat. Dengan demikian, solusi yang ditawarkan adalah menambah petugas layanan kesehatan dan menjamin kesejahteraan petugas layanan kesehatan sehingga menciptakan pelayanan yang efektif dan efisien', '2025-06-10 05:49:40', '2025-06-10 05:49:40'),
(94, 10, NULL, 8, NULL, 'Universitas telah menyediakan papan pengumuman atau platform online untuk memberikan informasi terkait layanan BK, seperti jadwal, materi konseling, atau informasi penting lainnya. Namun, tidak semua lembaga memiliki sistem informasi yang cukup jelas atau mudah diakses oleh mahasiswa. Solusi yang ditawarkan adalah membuat penyediaan akses informasi yang jelas dan mudah diakses akan mempermudah mahasiswa dalam mengetahui jadwal dan prosedur untuk mengakses layanan BK yang efktif', '2025-06-10 05:51:47', '2025-06-10 05:51:47'),
(95, 10, NULL, 12, NULL, 'Keandalan petugas BK juga tercermin dalam kemampuannya untuk menjaga kerahasiaan informasi pribadi mahasiswa dan mematuhi kode etik profesi. Sebagian besar petugas BK dapat diandalkan dalam hal ini, tetapi masih ada beberapa yang kurang memperhatikan pentingnya kerahasiaan atau terlibat dalam perilaku yang kurang etis, yang dapat merusak kepercayaan mahasiswa terhadap layanan BK. Solusi yang ditawarkan adalah memberikan pelatihan dan worksho kepada petugas BK terkait pentingnya kerahasiaan informasi pribadi dan kode etik sehingga pelayanan di BK dapat dilaksanakn secara baik dan ekeftif', '2025-06-10 05:54:41', '2025-06-10 05:54:41'),
(96, 11, NULL, 12, NULL, 'Rendahnya kepuasan mahasiswa terhadap pelayanan petugas Bimbingan Konseling (BK) menunjukkan adanya kesenjangan antara harapan mahasiswa dan pelayanan yang diberikan oleh petugas BK. Beberapa akar masalah yang diidentifikasi dari kondisi lapangan adalah sebagai berikut:\n1.	Pelayanan yang Kurang Responsif dan Personal\nMahasiswa belum memperoleh pelayanan yang responsive dan personal, dimana pelayanan BK bersifat formal dan tidak menyentuh kebutuhan personal atau masalah individual yang dihadapi mahasiswa, seperti stres akademik, kecemasan, burnout, atau kesulitan sosial.\n2.	Minimnya Jadwal dan Akses Konsultasi\nWaktu pelayanan yang terbatas, tidak fleksibel, dan tidak berbasis sistem antrian daring atau konsultasi hybrid (offline/online) membuat mahasiswa kesulitan menjangkau layanan BK saat dibutuhkan secara mendesak. Selain itu, sistem pelayanan yang terpusat di satu satuan tugas yang terletak di Kampus 1 UNG menjadi salah satu penyebab sulitnya akses bagi mahasiswa di kampus 4 UNG.\n3.	Stigma dan Kurangnya Sosialisasi Layanan BK\nBanyak mahasiswa yang belum memahami tujuan, manfaat, dan jenis layanan yang bisa diberikan oleh BK. Beberapa mahasiswa memiliki persepsi bahwa datang ke BK hanya untuk mahasiswa yang bermasalah, bukan untuk pengembangan diri secara umum.\n\nRekomendasi Perbaikan\nUntuk UPPS (Unit Pengelola Program Studi):\n1.	Membangun Sistem Pelayanan Konseling Modern\nMenerapkan sistem layanan konseling berbasis digital (booking online, konsultasi via Zoom/Google Meet, hotline konseling, dan lainnya.) untuk memudahkan mahasiswa dalam mengakses layanan kapan saja dan di mana saja.\n2.	Menambah Tenaga Konselor Profesional\nMengusulkan pengadaan atau penempatan konselor profesional dari latar belakang psikologi/konseling pendidikan tinggi agar layanan menjadi lebih tepat sasaran.\nUntuk Program Studi (PS):\n1.	Sosialisasi Aktif tentang Peran dan Fungsi BK\nMengadakan kegiatan pengenalan layanan BK pada saat orientasi mahasiswa baru dan menyertakan sesi khusus dalam perkuliahan umum atau seminar pengembangan diri untuk menurunkan stigma.\n2.	Membangun Program Konseling Preventif dan Progresif\nMengintegrasikan layanan BK dengan kegiatan mentoring akademik, pengembangan soft skills, dan pemantauan kesejahteraan psikologis mahasiswa secara rutin, tidak hanya ketika muncul masalah.\n3.	Penerapan Sistem Evaluasi Layanan BK\nMembuat sistem umpan balik (feedback form) dari mahasiswa setiap akhir semester untuk menilai kualitas layanan petugas BK, serta menjadikannya dasar evaluasi kinerja dan perbaikan layanan.', '2025-06-10 06:06:20', '2025-06-10 06:06:20'),
(98, 11, NULL, 15, NULL, 'Tingkat kepuasan mahasiswa terhadap prosedur layanan kesehatan di Kampus 4 Universitas Negeri Gorontalo (UNG) masih rendah. Hal ini mencerminkan ketidakefektifan sistem yang berjalan saat ini dalam menjawab kebutuhan mahasiswa akan layanan kesehatan kampus yang cepat, jelas, dan terjangkau. Akar permasalahan yang teridentifikasi antara lain:\n1.	Belum Tersedianya Poliklinik di Kampus 4\nMahasiswa di Kampus 4 tidak memiliki akses langsung ke fasilitas kesehatan kampus, karena layanan poliklinik hanya tersedia di Kampus 1 yang berjarak cukup jauh. Dalam kondisi darurat atau sakit ringan sekalipun, mahasiswa kesulitan mendapatkan penanganan cepat.\n2.	Ketidakjelasan Prosedur Akses Layanan Kesehatan\nMahasiswa tidak mengetahui alur layanan jika mengalami gangguan kesehatan, termasuk apakah mereka dapat langsung dirujuk ke Poliklinik Kampus 1, fasilitas apa saja yang bisa dimanfaatkan, dan siapa yang dapat dihubungi dalam situasi darurat.\n3.	Tidak Adanya Sistem Dukungan Kesehatan Alternatif\nBelum tersedia sistem pendukung seperti pos kesehatan, kotak P3K terstandar, tenaga medis siaga, atau kerja sama dengan fasilitas kesehatan lokal untuk penanganan awal atau rujukan cepat dari Kampus 4.\n\nRekomendasi Perbaikan\nUntuk UPPS (Unit Pengelola Program Studi):\n1.	Menginisiasi Pembentukan Pos Layanan Kesehatan Dasar di Kampus 4\nMengusulkan pembentukan health post atau ruang pertolongan pertama yang dilengkapi P3K, alat kesehatan dasar, serta jadwal kunjungan tenaga medis dari Poliklinik Kampus 1 secara berkala ke Kampus 4.\n2.	Menyusun dan Mempublikasikan SOP Layanan Kesehatan\nMerancang prosedur standar layanan kesehatan kampus yang mudah dipahami mahasiswa, lengkap dengan alur evakuasi, nomor kontak darurat, dan alur rujukan ke Poliklinik Kampus 1 atau fasilitas kesehatan mitra.\n3.	Membangun Kerja Sama dengan Klinik/Puskesmas Terdekat\nMelakukan MoU atau koordinasi informal dengan fasilitas kesehatan terdekat dari Kampus 4 untuk penanganan awal mahasiswa, sehingga ada rujukan cepat jika terjadi kondisi yang membutuhkan penanganan medis.\nUntuk Program Studi (PS):\n1.	Melakukan Sosialisasi Prosedur Layanan Kesehatan ke Mahasiswa\nMenyampaikan panduan prosedur layanan kesehatan melalui media komunikasi kampus (grup WhatsApp angkatan, web Prodi, pamflet digital) dan memasukkan orientasi layanan kesehatan dalam kegiatan PKKMB atau pertemuan awal semester.\n2.	Menunjuk Koordinator Kesehatan di Tingkat Prodi\nMenetapkan satu orang dosen atau tenaga kependidikan sebagai koordinator layanan kesehatan yang menjadi penghubung antara mahasiswa, pihak UPPS, dan Poliklinik Kampus 1, khususnya untuk keperluan administratif atau darurat.\n3.	Mendorong Mahasiswa Mengakses Layanan Kesehatan dengan Mudah\nMemberikan arahan dan motivasi kepada mahasiswa untuk tidak ragu memanfaatkan layanan kesehatan yang tersedia, serta menghapus stigma bahwa layanan tersebut hanya untuk kondisi yang parah.', '2025-06-10 06:12:51', '2025-06-10 06:12:51'),
(99, 12, NULL, 9, 'Perbaikan fasilitas fisik, seperti peningkatan kualitas gedung dan alat kesehatan, serta penataan aksesibilitas yang lebih baik dapat meningkatkan kenyamanan dan kepuasan mahasiswa. Selain itu, pengadaan fasilitas tambahan seperti ruang tunggu yang lebih nyaman dan jalur akses yang lebih luas dapat meningkatkan pengalaman pengguna.', 'Aksesibilitas dan kualitas sarana prasarana layanan kesehatan masih dinilai kurang optimal meskipun mendapatkan predikat \"Puas\" dengan tingkat kepuasan 66.67%. Hal ini dapat mengindikasikan adanya kesenjangan antara harapan mahasiswa dan kenyataan di lapangan, seperti fasilitas yang tidak memadai atau tidak mudah dijangkau.', '2025-06-10 06:15:29', '2025-06-10 06:15:52'),
(100, 11, NULL, 20, NULL, 'Rendahnya tingkat kepuasan mahasiswa terhadap kesigapan petugas layanan kesehatan menandakan adanya kelemahan dalam kemampuan kampus merespons kebutuhan medis mahasiswa secara cepat dan tepat. Beberapa akar permasalahan utama yang dapat diidentifikasi adalah:\n1.	Tidak Tersedianya Petugas Kesehatan di Kampus 4\nKampus 4 Universitas Negeri Gorontalo belum memiliki poliklinik atau unit layanan kesehatan tetap, sehingga juga tidak memiliki petugas kesehatan yang siap siaga di lokasi kampus. Dalam situasi darurat, mahasiswa tidak tahu harus menghubungi siapa, dan penanganan pertama menjadi terhambat.\n2.	Ketiadaan Prosedur Darurat yang Efisien\nTidak ada mekanisme cepat tanggap (emergency response system) seperti nomor layanan darurat internal, petugas piket kesehatan, atau sistem pelaporan kondisi darurat di lingkungan kampus. Hal ini menyebabkan respon terhadap insiden kesehatan menjadi lambat dan tidak terkoordinasi.\n3.	Kurangnya Koordinasi antara Kampus 4 dan Poliklinik Kampus 1\nTidak ada alur koordinasi yang aktif dan cepat antara Kampus 4 dengan layanan kesehatan Kampus 1 atau pihak medis luar kampus untuk menghadapi kondisi darurat atau layanan harian, yang mengakibatkan keterlambatan penanganan.\nRekomendasi Perbaikan\nUntuk UPPS (Unit Pengelola Program Studi):\n1.	Menyiapkan Petugas Piket Kesehatan atau Tim Tanggap Darurat\nMenugaskan tenaga kependidikan atau satpam kampus yang telah dilatih dasar P3K sebagai first responder yang berjaga di jam kerja, lengkap dengan kotak P3K dan alat bantu medis ringan.\n2.	Menjalin MoU Layanan Darurat dengan Fasilitas Kesehatan Terdekat\nMembuat kerja sama dengan puskesmas atau klinik sekitar Kampus 4 agar dapat memberikan layanan prioritas atau kunjungan medis cepat jika dibutuhkan.\n3.	Pembangunan Sistem Tanggap Cepat Berbasis Teknologi\nMengembangkan sistem pelaporan darurat berbasis aplikasi mobile atau Google Form yang langsung terkoneksi dengan petugas kampus, koordinator kesehatan, atau poliklinik pusat, sehingga laporan langsung direspons dalam hitungan menit.\nUntuk Program Studi (PS):\n1.	Sosialisasi Panduan Tindakan Darurat kepada Mahasiswa\nMenyediakan panduan sederhana berbentuk infografik tentang langkah-langkah yang harus dilakukan mahasiswa jika mengalami atau menyaksikan kondisi medis darurat (siapa yang dihubungi, lokasi bantuan, dst.), disebarluaskan melalui grup kelas atau mading kampus.\n2.	Melakukan Simulasi Penanganan Darurat di Kampus\nBekerja sama dengan UKM KSR (Korps Sukarela) atau instansi kesehatan untuk mengadakan pelatihan dan simulasi penanganan kegawatdaruratan secara berkala, agar seluruh civitas akademika memiliki kesadaran dan kemampuan dasar penanganan medis.\n3.	Menunjuk Koordinator Respons Layanan Kesehatan\nMenetapkan seorang dosen atau tenaga kependidikan yang ditugaskan sebagai penghubung tanggap kesehatan di tingkat prodi, guna mempercepat koordinasi apabila terjadi kasus mendadak.', '2025-06-10 06:16:30', '2025-06-10 06:16:30'),
(101, 12, NULL, 15, 'Penyederhanaan prosedur administrasi dan peningkatan efisiensi layanan, seperti pengurangan waktu tunggu dan perbaikan alur layanan, dapat meningkatkan kualitas prosedur. Pelatihan bagi petugas untuk memberikan informasi yang lebih jelas dan cepat juga sangat diperlukan guna meningkatkan kepercayaan pengguna.\n\n', 'Prosedur layanan kesehatan dinilai cukup baik, namun tingkat kepuasan sebesar 66.67% menunjukkan bahwa ada beberapa area yang perlu diperbaiki. Prosedur yang berbelit-belit atau waktu tunggu yang lama menjadi faktor yang mengurangi kepuasan.', '2025-06-10 06:16:59', '2025-06-10 06:17:28'),
(102, 12, NULL, 8, 'Peningkatan sosialisasi mengenai layanan BK juga penting agar mahasiswa lebih aktif dalam memanfaatkan fasilitas yang ada.', ' Layanan bimbingan dan konseling (BK) mendapatkan predikat \"Puas\" dengan tingkat kepuasan 67.67%. Namun, masih ada keluhan terkait ketersediaan fasilitas dan aksesibilitasnya di lingkungan fakultas dan Jurusan. Pada tingkat Universitas layanan bimbingan dan konseling sudah berjalan dengan baik namun, informasi layanan tersebut tidak sampai ke mahasiswa', '2025-06-10 06:22:13', '2025-06-10 06:22:57'),
(103, 11, NULL, 81, NULL, 'Rendahnya tingkat kepuasan mahasiswa terhadap transparansi dalam pemberian nilai mengindikasikan bahwa proses penilaian akademik belum sepenuhnya terbuka, adil, dan dapat dipertanggungjawabkan. Ketidakpastian ini dapat menimbulkan persepsi negatif terhadap dosen, sistem evaluasi, dan kredibilitas lembaga. Beberapa akar permasalahan utama adalah:\n1.	Minimnya Umpan Balik atas Tugas dan Ujian\nBanyak dosen belum memberikan umpan balik secara eksplisit terhadap hasil ujian, tugas, atau presentasi mahasiswa. Mahasiswa tidak tahu letak kesalahannya, tidak mendapat penjelasan nilai, dan merasa penilaian dilakukan secara sepihak.\n2.	Tidak Diumumkannya Detail Rekap Nilai Secara Terbuka\nProses rekapitulasi nilai sering kali hanya diumumkan dalam bentuk nilai akhir (misalnya A, B, C) tanpa penjelasan mengenai nilai komponen penyusunnya (misalnya tugas individu, kuis, UTS, UAS). Ini menimbulkan kebingungan dan dugaan ketidaktransparanan.\nRekomendasi Perbaikan\nUntuk UPPS (Unit Pengelola Program Studi):\n1.	Mendorong Penerapan Kontrak Kuliah yang Memuat Skema Penilaian\nMenegaskan kepada seluruh dosen agar mencantumkan secara tertulis dan jelas komponen penilaian dalam RPS (Rencana Pembelajaran Semester) dan menyampaikan di awal perkuliahan kepada mahasiswa.\n2.	Menyusun Panduan Penilaian Akademik yang Transparan\nMengembangkan pedoman penilaian untuk seluruh dosen yang menekankan transparansi, pemberian umpan balik, dan pentingnya rekap nilai komprehensif yang dapat diakses oleh mahasiswa.\n3.	Menerapkan Sistem Digitalisasi Nilai Bertahap\nMengembangkan atau memaksimalkan penggunaan Learning Management System (LMS) atau platform daring untuk mencatat dan menampilkan progres nilai mahasiswa selama semester berlangsung.\nUntuk Program Studi (PS):\n1.	Mewajibkan Dosen Memberikan Rekapitulasi Nilai Komponen\nSebelum penginputan nilai akhir di sistem akademik, dosen diwajibkan memberikan rekap nilai komponen (tugas, ujian, kuis, dsb.) yang dapat diakses mahasiswa dan diberi waktu untuk klarifikasi jika ada kekeliruan.\n2.	Membuka Mekanisme Banding Nilai yang Profesional\nMenyediakan forum atau waktu khusus di akhir semester bagi mahasiswa yang ingin berdiskusi atau mengajukan pertanyaan terkait nilai mereka secara akademis dan sopan.', '2025-06-10 06:24:12', '2025-06-10 06:24:12'),
(104, 12, NULL, 20, 'Solusi untuk masalah ini meliputi beberapa langkah penting. Pertama, Kampus 4 harus segera mendirikan poliklinik atau unit layanan kesehatan tetap agar petugas kesehatan dapat siap siaga di lokasi kampus. Kedua, perlu dikembangkan prosedur darurat yang efisien, seperti nomor layanan darurat internal dan sistem tanggap darurat yang mudah diakses mahasiswa. Ketiga, penting untuk meningkatkan koordinasi antara Kampus 4 dan Poliklinik Kampus 1, serta pihak medis luar kampus. Penyusunan prosedur rujukan yang jelas dan sistem pelaporan yang efektif dapat mempercepat penanganan kondisi darurat dan memastikan respons yang lebih cepat dan terkoordinasi.', 'Meskipun petugas layanan kesehatan mendapatkan penilaian baik dengan tingkat kepuasan 68,24%, keluhan terkait respon lambat dan ketidakmampuan petugas menangani masalah mendesak masih ditemui. Beberapa akar permasalahan utama yang diidentifikasi antara lain: 1) Tidak adanya petugas kesehatan tetap di Kampus 4 Universitas Negeri Gorontalo, yang belum memiliki poliklinik atau unit layanan kesehatan, sehingga mahasiswa kesulitan dalam situasi darurat. 2) Ketiadaan prosedur darurat yang efisien, seperti sistem tanggap darurat atau nomor layanan darurat internal.', '2025-06-10 06:25:47', '2025-06-10 06:26:29'),
(106, 12, NULL, 12, 'Solusi untuk permasalahan ini antara lain, pertama, petugas Bimbingan Konseling (BK) perlu diberikan pelatihan untuk memberikan pendekatan yang lebih personal dan responsif, sehingga mahasiswa dapat merasa lebih dihargai dan didengarkan dalam menghadapi masalah pribadi seperti stres akademik atau kecemasan. Kedua, perlu ada peningkatan fleksibilitas jadwal layanan BK, termasuk penambahan waktu konsultasi di luar jam kuliah dan penerapan sistem antrian daring. Implementasi layanan konsultasi hybrid (offline dan online) juga dapat mempermudah akses mahasiswa, terutama bagi mereka yang kesulitan datang langsung ke kantor BK. Hal ini akan membantu mahasiswa mengakses layanan dengan lebih mudah dan tepat waktu.', 'Nilai kepuasan 70% menunjukkan bahwa kemampuan petugas Bimbingan Konseling (BK) dalam memberikan pelayanan memuaskan sudah baik, namun masih terdapat ruang untuk perbaikan. Kesenjangan antara harapan mahasiswa dan pelayanan yang diberikan mencerminkan adanya masalah dalam layanan BK. Beberapa akar permasalahan yang diidentifikasi adalah pelayanan yang kurang responsif dan personal, di mana mahasiswa belum menerima pendekatan yang lebih mendalam terhadap masalah pribadi seperti stres akademik atau kecemasan. Selain itu, minimnya jadwal dan akses konsultasi yang terbatas, serta ketiadaan sistem antrian daring atau layanan konsultasi hybrid, membuat mahasiswa kesulitan dalam mengakses layanan BK saat dibutuhkan.', '2025-06-10 06:29:23', '2025-06-10 06:29:38'),
(107, 11, NULL, 111, NULL, 'Rendahnya kepuasan mahasiswa terhadap layanan peminjaman atau penggunaan fasilitas kampus untuk kegiatan kemahasiswaan menunjukkan adanya kendala dalam kecepatan, kemudahan, dan keramahan layanan. Mahasiswa merasa kebutuhan mereka terhadap ruang dan alat penunjang kegiatan belum sepenuhnya difasilitasi secara profesional dan solutif. Beberapa akar masalah yang teridentifikasi antara lain:\n1.	Prosedur Peminjaman yang terlalu birokratis\nProsedur peminjaman ruang kelas, aula, atau alat-alat kegiatan (sound system, kursi tambahan, LCD proyektor, dan lainnya.) terlalu birokratis, melibatkan banyak pihak, dan memakan waktu lama.\n2.	Kurangnya Kejelasan Jadwal dan Ketersediaan Fasilitas\nMahasiswa kesulitan memperoleh informasi real-time tentang jadwal penggunaan ruang/fasilitas dan sering terjadi tumpang tindih pemakaian. Belum tersedia sistem informasi yang transparan dan dapat diakses mahasiswa untuk mengecek atau memesan fasilitas kampus.\n3.	Kurangnya Responsif dan Empati dari Petugas\nBeberapa mahasiswa merasakan bahwa petugas pengelola sarana prasarana kurang komunikatif, tidak ramah, atau cenderung pasif dalam memberikan solusi ketika mahasiswa mengalami kendala teknis (misal: ruang terkunci, alat rusak, atau peminjaman ditolak tanpa penjelasan).\n4.	Minimnya Sosialisasi tentang Alur dan Syarat Peminjaman\nTidak semua mahasiswa, khususnya pengurus organisasi kemahasiswaan, memahami bagaimana prosedur formal meminjam fasilitas, kepada siapa harus mengajukan, dan syarat apa saja yang perlu dilengkapi.\nRekomendasi Perbaikan\nUntuk UPPS (Unit Pengelola Program Studi):\n1.	Digitalisasi Proses Peminjaman Fasilitas\nMembangun sistem peminjaman daring berbasis aplikasi, Google Form, atau Website yang menampilkan jadwal ketersediaan ruang dan fasilitas, serta memungkinkan mahasiswa mengajukan permohonan dengan mudah dan cepat.\n2.	Penyusunan SOP Pelayanan Fasilitas Berorientasi Mahasiswa\nMenyusun standar pelayanan minimal yang berpusat pada kebutuhan mahasiswa dengan prinsip fleksibilitas, efisiensi waktu, dan pendekatan solusi. SOP ini juga dapat mencakup waktu respon maksimum dan mekanisme penanganan keluhan.\n3.	Pelatihan Layanan Prima untuk Petugas Sarpras\nMemberikan pelatihan komunikasi layanan prima kepada staf sarana prasarana agar memiliki keterampilan komunikasi efektif, empati, dan mampu menjelaskan prosedur secara persuasif kepada mahasiswa.\nUntuk Program Studi (PS):\n1.	Sosialisasi Prosedur Peminjaman secara Berkala\nMembuat panduan visual (poster, infografis, video tutorial) dan menyebarkannya melalui media sosial, grup organisasi kemahasiswaan, atau mading kampus tentang cara meminjam fasilitas dengan benar.\n2.	Membuka Kotak Saran atau Survei Cepat Layanan Fasilitas\nMenyediakan kanal masukan berbasis Google Form atau QR Code untuk mendapatkan feedback mahasiswa terhadap pelayanan sarpras, yang dapat ditindaklanjuti untuk perbaikan berkelanjutan.', '2025-06-10 06:33:21', '2025-06-10 06:33:21'),
(111, 7, NULL, 9, 'Perlu adanya perbaikan dan pemutakhiran fasilitas kesehatan secara berkala, memperjelas informasi mengenai lokasi dan jam operasional layanan, serta memastikan fasilitas yang tersedia dalam kondisi layak dan mendukung kenyamanan mahasiswa.', 'Hasil survei menunjukkan bahwa aspek Kecukupan Aksesibilitas dan Kualitas Sarana Prasarana Layanan Kesehatan (Aspek Tangibles)  memperoleh tingkat kepuasan sebesar 69,76%, yang merupakan nilai terendah dibandingkan aspek lainnya. Hal ini mengindikasikan bahwa mahasiswa masih merasa bahwa sarana dan prasarana layanan kesehatan di UNG belum memadai, baik dari segi kualitas maupun kemudahan akses.', '2025-06-11 05:54:04', '2025-06-11 05:56:29'),
(112, 7, NULL, 15, 'Perlu penyederhanaan alur prosedur layanan agar lebih praktis dan mudah dipahami. Selain itu, sosialisasi secara aktif melalui berbagai media kampus perlu ditingkatkan untuk memastikan seluruh mahasiswa mengetahui langkah-langkah yang harus ditempuh saat mengakses layanan kesehatan.', 'Persentase sebesar 70,50% pada aspek Prosedur Layanan Kesehatan (Reliability), menunjukkan bahwa sebagian besar mahasiswa merasa prosedur layanan kesehatan cukup dapat diandalkan. Namun demikian, terdapat indikasi bahwa beberapa prosedur dinilai masih kurang efisien atau kurang tersosialisasikan dengan baik.', '2025-06-11 06:00:51', '2025-06-11 06:01:46'),
(114, 7, NULL, 20, 'Perlu peningkatan kapasitas petugas layanan kesehatan melalui pelatihan tanggap darurat dan komunikasi efektif. Selain itu, perlu dipertimbangkan penambahan jumlah petugas atau sistem pendukung lainnya untuk menghindari penumpukan layanan, serta penerapan sistem antrean yang tertib.', 'Aspek kesigapan petugas memperoleh tingkat kepuasan sejumlah 71,48%, yang menunjukkan bahwa meskipun petugas layanan kesehatan dianggap cukup responsif, masih terdapat ekspektasi mahasiswa terhadap pelayanan yang lebih cepat dan tanggap.', '2025-06-11 06:08:31', '2025-06-11 06:09:18'),
(115, 7, NULL, 23, 'Perlu dilakukan pelatihan berkelanjutan bagi petugas BK, terutama dalam keterampilan komunikasi, konseling, serta pemahaman psikologis mahasiswa. Fasilitas pendukung layanan BK juga harus dijaga agar mampu memberikan kenyamanan dan menjamin kerahasiaan dalam setiap sesi konseling.', 'Hasil survei aspek Assurance mendapatkan tingkat kepuasan sebesar 72,80%, hal ini menunjukkan bahwa sebagian besar mahasiswa merasa percaya terhadap kompetensi petugas Bimbingan dan Konseling (BK) dalam memberikan layanan, namun belum sepenuhnya puas terhadap kualitas interaksi yang diberikan.', '2025-06-11 06:12:22', '2025-06-11 06:12:49'),
(116, 7, NULL, 27, 'Membentuk tim khusus atau sistem pelaporan yang lebih responsif terhadap keluhan mahasiswa, Menyediakan ruang konseling yang privat, nyaman, dan kedap suara untuk menjaga kerahasiaan, Memberikan fleksibilitas waktu layanan (misalnya, layanan sore atau daring) untuk menjangkau lebih banyak mahasiswa. Selain itu, peningkatan kemampuan empatik dan komunikasi interpersonal petugas sangat penting agar mahasiswa merasa dihargai dan didengarkan dengan sungguh-sungguh.', 'Aspek Empathy memperoleh tingkat kepuasan 72,99% yang merupakan nilai tertinggi dibandingkan aspek lainnya, Artinya, mahasiswa menilai bahwa petugas layanan kesehatan sudah menunjukkan kepedulian dan perhatian dalam menerima keluhan, tetapi belum optimal', '2025-06-11 06:14:15', '2025-06-11 06:16:13'),
(118, 12, NULL, 34, 'perlu dilakukan perbaikan pada fasilitas media pembelajaran, seperti pemasangan proyektor dan layar LCD permanen di setiap ruang kelas. Selain itu, pemeliharaan rutin kabel HDMI dan perangkat lainnya sangat penting agar tidak terjadi kerusakan. Ruang kelas yang belum dilengkapi layar LCD sebaiknya segera dipasang untuk memastikan tampilan proyeksi yang jelas. Pengembangan sistem pemantauan kerusakan peralatan dan survei kepuasan berkala akan membantu mengidentifikasi masalah dan mencari solusi tepat waktu. Dengan alokasi anggaran yang tepat dan kerjasama dengan pihak ketiga, fasilitas pembelajaran dapat terus diperbarui untuk mendukung proses belajar yang lebih optimal', 'Hasil survei menunjukkan tingkat kepuasan sebesar 65,91%, yang mencerminkan ketidakpuasan sebagian besar responden terhadap fasilitas media pembelajaran, seperti LCD dan layar LCD. Temuan ini mengindikasikan adanya ketidakefektivitan pembelajaran. Beberapa ruang kelas tidak dilengkapi dengan proyektor LCD permanen. Di kelas yang telah terpasang LCD namun, kabel HDMI rusak atau tidak berfungsi. Selain itu, beberapa ruang kelas belum dilengkapi dengan layar LCD, sehingga proyeksi dilakukan langsung ke papan tulis atau dinding, mengakibatkan tampilan yang terpotong dan kurang jelas.', '2025-06-12 03:50:16', '2025-06-12 03:50:39'),
(119, 12, NULL, 35, 'perlu dilakukan perbaikan dan penggantian peralatan yang rusak serta penambahan jumlah peralatan yang sering digunakan dalam praktikum. Selain itu, pengelolaan suhu ruangan harus diperhatikan dengan memasang pendingin udara atau sistem ventilasi yang lebih baik untuk menciptakan lingkungan yang nyaman dan mendukung konsentrasi. Pemeliharaan rutin terhadap fasilitas laboratorium juga sangat penting untuk menjaga agar peralatan tetap dalam kondisi optimal. Dengan peningkatan kualitas dan kelengkapan fasilitas tersebut, diharapkan tingkat kepuasan akan meningkat dan praktikum dapat dilakukan dengan lebih efektif dan nyaman', 'Tingkat kepuasan sebesar 68,18% menunjukkan bahwa meskipun mayoritas responden menilai ruang praktek atau laboratorium sudah cukup lengkap, beberapa fasilitas masih belum memenuhi standar yang diharapkan atau dalam kondisi yang optimal. Beberapa peralatan yang ada di laboratorium kimia mengalami kerusakan dan memerlukan perbaikan atau penggantian, sementara jumlah peralatan tertentu yang sering digunakan dalam praktikum juga masih terbatas. Selain itu, beberapa dosen mengungkapkan keluhan terkait suhu ruangan di laboratorium kimia yang tidak mendukung, khususnya suhu yang terlalu panas, yang dapat mempengaruhi kenyamanan dan konsentrasi dalam pelaksanaan praktikum. Hal ini menunjukkan perlunya peningkatan kualitas dan kelengkapan fasilitas laboratorium kimia', '2025-06-12 03:52:14', '2025-06-12 03:52:33'),
(120, 12, NULL, 39, 'perlu dilakukan pengadaan dan pemeliharaan peralatan medis yang lebih lengkap dan memadai. Selain itu, penambahan sumber daya seperti tenaga medis dan staf pendukung yang kompeten juga penting untuk mempercepat proses pelayanan. Pemantauan berkala terhadap fasilitas dan peralatan yang ada harus dilakukan agar segera diketahui kekurangan atau kerusakan, sehingga bisa ditangani dengan cepat. Dengan meningkatkan kualitas fasilitas dan sumber daya, diharapkan tingkat kepuasan pengguna poliklinik dapat meningkat dan pelayanan kesehatan menjadi lebih optimal', 'Dengan tingkat kepuasan 68.18%, ada indikasi bahwa fasilitas di poliklinik belum memenuhi harapan sebagian pengguna. Meskipun sudah ada fasilitas medis, beberapa peralatan atau sumber daya lainnya tidak lengkap atau kurang memadai dalam mendukung pelayanan kesehatan', '2025-06-12 03:53:46', '2025-06-12 03:54:05'),
(121, 12, NULL, 41, 'perlu dibuat zona parkir khusus untuk dosen guna menghindari persaingan tempat parkir dengan mahasiswa, terutama pada jam sibuk. Selain itu, fasilitas parkir harus diperbaiki dengan penambahan atap pelindung, pemasangan penanda yang jelas, dan perbaikan permukaan yang tidak rata untuk menciptakan kenyamanan. Pengelolaan dan pengawasan yang lebih baik juga penting untuk memastikan penggunaan lahan parkir yang efisien dan teratur. Dengan langkah-langkah ini, diharapkan fasilitas parkir menjadi lebih nyaman dan efisien, serta dapat meningkatkan kepuasan dosen secara keseluruhan.', 'Hasil survei menunjukkan kepuasan dosen terhadap fasilitas parkir di kampus rendah. Masalah utama yang ditemukan adalah tidak adanya pemisahan antara area parkir dosen dan mahasiswa, mengakibatkan persaingan tempat parkir, terutama pada jam sibuk. Selain itu, fasilitas parkir kurang nyaman karena tidak ada penanda yang jelas, atap pelindung, dan permukaan yang tidak rata. Kurangnya pengelolaan dan pengawasan juga menyebabkan ketidak efisienan penggunaan lahan parkir. Solusinya adalah dengan membuat zona parkir khusus dosen, memperbaiki fasilitas parkir, serta meningkatkan pengelolaan dan pengawasan untuk memastikan penggunaan area parkir yang lebih efisien dan nyaman', '2025-06-12 03:56:17', '2025-06-12 03:56:37'),
(123, 7, NULL, 33, 'Perlu dilakukan pengecekan dan perbaikan secara berkala pada fasilitas ruang kuliah, Perlu penambahan ruang kuliah baru agar ketersediaan ruang kuliah sesuai dengan jumlah mahasiswa, serta dapat melibatkan dosen dan mahasiswa dalam survei kepuasan dan kebutuhan ruang kelas.', 'Temuan awal menunjukkan bahwa aspek ruang kelas mendapatkan tingkat kepuasan terendah, yaitu hanya 57,50%, dengan mutu layanan masuk dalam kategori C (Kurang Baik). Hal ini mengindikasikan bahwa sebagian dosen di Fakultas MIPA UNG merasa fasilitas ruang perkuliahan belum sepenuhnya mendukung proses pembelajaran secara optimal. Beberapa permasalahan yang sering muncul misalnya kapasitas ruang yang tidak sesuai jumlah mahasiswa, kurangnya kenyamanan ruang kuliah dari sisi pencahayaan, ventilasi, dan alat pendingin ruangan yang tidak berfungsi serta banyak ruang kuliah yang menggunakan laboratorium.', '2025-06-12 04:26:53', '2025-06-12 04:27:50'),
(124, 7, NULL, 34, 'Perlu melakukan inventarisasi dan pemeriksaan kelayakan alat bantu pembelajaran setiap semester dan melengkapi media pembelajaran tersebut pada ruang kuliah yang masih belum tersedia', 'Aspek ini memperoleh tingkat kepuasan sebesar 60,00%, yang tergolong cukup puas, namun masih berada dalam kategori mutu layanan C (Kurang Baik). berdasarkan hasil survei, Dosen FMIPA UNG menyampaikan bahwa kelengkapan dan kualitas media pembelajaran seperti LCD projector, speaker, atau layar presentasi di kelas masih belum konsisten tersedia atau sering mengalami gangguan teknis, bahkan pada beberapa ruang kuliah tidak tersedia.', '2025-06-12 04:30:21', '2025-06-12 04:40:07'),
(125, 7, NULL, 37, 'Perlu menambah koleksi buku ajar, modul, dan jurnal terbitan terbaru yang relevan dengan kurikulum, Fakultas MIPA UNG perlu mengupayakan langganan jurnal online melalui konsorsium nasional atau kerja sama mitra', 'Tingkat kepuasan untuk aspek kelengkapan referensi di ruang baca dan perpustakaan juga berada di angka 60,00%, menunjukkan perlunya peningkatan pada ketersediaan literatur akademik, baik cetak maupun digital. Dosen merasa referensi yang tersedia belum cukup mendukung pengembangan bahan ajar, penelitian, dan pembimbingan akademik.', '2025-06-12 04:51:31', '2025-06-12 04:53:17'),
(128, 6, NULL, 41, NULL, 'Fasilitas parkir yang tersedia saat ini masih terbatas dan belum mampu menampung jumlah kendaraan dosen secara optimal. Ketiadaan penataan yang jelas seperti marka atau zonasi menyebabkan penggunaan area parkir menjadi tidak tertib, ditambah lagi tidak adanya pelindung dari sinar matahari dan hujan yang menyebabkan kendaraan dosen kurang terlindungi. Oleh karena itu, diperlukan penataan ulang area parkir yang lebih terorganisir, penambahan pelindung kendaraan, serta penerapan sistem parkir berbasis identitas agar penggunaannya lebih tertib dan nyaman.', '2025-06-13 01:24:48', '2025-06-13 01:24:48'),
(129, 6, NULL, 51, NULL, 'Proses penyusunan rencana bisnis dan anggaran masih berlangsung secara tertutup, tanpa melibatkan dosen secara aktif dalam pengambilan keputusan. Minimnya forum diskusi dan saluran aspirasi membuat masukan dari dosen belum terserap dengan baik dalam perencanaan. Untuk itu, perlu dibuka ruang partisipasi melalui forum rutin serta disediakan kanal komunikasi daring agar dosen dapat terlibat secara aktif dalam menyampaikan kebutuhan akademik.', '2025-06-13 01:26:09', '2025-06-13 01:26:09'),
(130, 6, NULL, 34, NULL, 'Beberapa ruang kelas masih menggunakan perangkat pembelajaran seperti LCD dan sound system yang tidak berfungsi optimal atau sudah usang. Ketidaksiapan teknis saat proses belajar mengajar seringkali mengganggu kelancaran perkuliahan. Selain itu, masih terdapat ruangan yang tidak memiliki LCD sama sekali, sementara LCD yang tersedia pun sering mengalami kendala, seperti kabel HDMI yang tidak berfungsi dan remot yang hilang. Oleh karena itu, perlu dilakukan pemeliharaan secara berkala terhadap fasilitas tersebut, penggantian alat yang sudah tidak layak pakai, penambahan perangkat di ruang yang belum memilikinya.', '2025-06-13 01:28:27', '2025-06-13 01:28:27'),
(131, 6, NULL, 33, NULL, 'Jumlah ruang kelas yang tersedia saat ini masih belum mencukupi untuk menampung seluruh aktivitas perkuliahan, terutama pada jam-jam sibuk. Kondisi ini menyebabkan beberapa mata kuliah terpaksa dilaksanakan di laboratorium komputer, yang sebenarnya tidak dirancang untuk kegiatan belajar mengajar reguler. Penggunaan ruang yang tidak sesuai ini dapat mengurangi kenyamanan dan efektivitas pembelajaran. Oleh karena itu, perlu dilakukan penambahan ruang kelas atau penjadwalan yang lebih efisien, serta optimalisasi pemanfaatan ruang yang ada agar seluruh perkuliahan dapat berlangsung di ruang yang layak dan sesuai peruntukannya.', '2025-06-13 01:52:06', '2025-06-13 01:52:06'),
(132, 6, NULL, 39, NULL, 'Layanan poliklinik saat ini hanya tersedia di kampus 1 , sementara di kampus 4 tempat dosen dan mahasiswa program studi matematika beraktivitas, belum tersedia fasilitas kesehatan serupa. Kondisi ini menyulitkan bagi yang membutuhkan layanan kesehatan ringan secara cepat, karena harus berpindah lokasi yang cukup jauh. Oleh karena itu, perlu adanya penyediaan fasilitas layanan kesehatan dasar di kampus 4, baik dalam bentuk unit poliklinik mandiri maupun kerja sama dengan penyedia layanan kesehatan terdekat, guna menjamin aksesibilitas dan kesejahteraan seluruh sivitas akademika di lingkungan kampus', '2025-06-13 01:55:52', '2025-06-13 01:55:52'),
(133, 6, NULL, 15, NULL, 'Prosedur layanan kesehatan mendapatkan tingkat kepuasan sebesar 67,24%, yang menunjukkan masih adanya ketidakjelasan dalam alur pelayanan serta minimnya informasi yang disediakan bagi mahasiswa. Kurangnya sosialisasi prosedur dan tidak tersedianya petunjuk yang mudah diakses membuat mahasiswa kesulitan memahami langkah-langkah yang harus diambil saat memerlukan layanan kesehatan. Oleh karena itu, perlu dibuat dan disebarluaskan standar operasional prosedur (SOP) secara tertulis maupun digital, serta dipasang di area strategis di lingkungan kampus agar mahasiswa dapat lebih mudah mengakses layanan dengan benar.', '2025-06-13 02:18:05', '2025-06-13 02:18:05'),
(135, 6, NULL, 20, NULL, 'Dengan tingkat kepuasan sebesar 67,73%, kesigapan petugas layanan kesehatan masih dianggap kurang memadai oleh sebagian mahasiswa. Hal ini disebabkan oleh tidak adanya petugas medis yang berjaga di kampus 4, sehingga mahasiswa kesulitan mendapatkan layanan kesehatan secara cepat, terutama saat kondisi darurat. Oleh karena itu, perlu disediakan minimal satu petugas medis tetap atau tenaga kesehatan terjadwal di kampus 4, serta disiapkan sistem rujukan atau komunikasi cepat dengan layanan di kampus utama agar kebutuhan layanan kesehatan dapat ditangani dengan lebih responsif dan merata.', '2025-06-13 02:24:07', '2025-06-13 02:24:07'),
(136, 6, NULL, 27, NULL, 'Aspek kepedulian petugas dalam menerima keluhan meraih tingkat kepuasan sebesar 68,68%. Persentase ini menunjukkan bahwa mahasiswa masih merasakan kurangnya empati atau keseriusan dalam menanggapi keluhan yang disampaikan. Minimnya wadah penyampaian aspirasi seperti forum dialog atau media pengaduan turut memperkuat persepsi tersebut. Oleh karena itu, perlu disediakan saluran komunikasi yang aktif seperti kotak saran, form pengaduan online, serta pelatihan keterampilan komunikasi empatik bagi petugas agar mampu memberikan tanggapan yang lebih manusiawi dan membangun kepercayaan mahasiswa.', '2025-06-13 02:25:15', '2025-06-13 02:25:15'),
(137, 6, NULL, 9, NULL, 'Tingkat kepuasan mahasiswa terhadap aksesibilitas dan kualitas sarana prasarana kesehatan adalah sebesar 68,97%, yang mencerminkan bahwa fasilitas kesehatan saat ini belum sepenuhnya memadai. Salah satu penyebab utamanya adalah tidak tersedianya fasilitas layanan kesehatan di seluruh kampus, seperti yang dialami mahasiswa di luar kampus  1. Oleh karena itu, diperlukan penambahan fasilitas kesehatan di kampus-kampus yang belum memilikinya, serta peningkatan kualitas alat dan ruang layanan yang tersedia agar akses mahasiswa terhadap layanan kesehatan menjadi lebih merata dan layak.', '2025-06-13 02:26:37', '2025-06-13 02:26:37'),
(138, 6, NULL, 23, NULL, 'Kemampuan petugas bimbingan dan konseling (BK) memperoleh tingkat kepuasan 68,90%, yang mengindikasikan bahwa meskipun cukup baik, masih terdapat ruang perbaikan dalam hal efektivitas komunikasi dan pendekatan terhadap permasalahan mahasiswa. Beberapa mahasiswa merasa belum mendapatkan solusi yang memadai atau merasa tidak nyaman dalam sesi konseling. Oleh karena itu, dibutuhkan pelatihan lanjutan untuk petugas BK guna meningkatkan keterampilan konseling, pendekatan psikologis, serta pemahaman terhadap isu-isu yang relevan dengan kehidupan mahasiswa.', '2025-06-13 02:27:24', '2025-06-13 02:27:24'),
(139, 7, NULL, 47, 'Peningkatan ketepatan waktu pencairan remunirasi serta melibatkan dosen melalui forum diskusi atau kuesioner lanjutan, untuk mengidentifikasi kendala administratif atau teknis yang mungkin terjadi selama pemenuhan kinerja.', 'Hasil survei menunjukkan bahwa tingkat kepuasan dosen terhadap ketepatan pemberian insentif atau remunerasi berdasarkan kinerja berada pada kategori Cukup Puas dengan nilai kepuasan sebesar 60,00% dan mutu layanan tergolong pada tingkat C (Kurang Baik). Persentase ini menandakan bahwa layanan pada aspek ini belum sepenuhnya memenuhi ekspektasi para dosen. Dosen merasa bahwa pencairan insentif sering mengalami keterlambatan yang berdampak pada perencanaan keuangan pribadi, apalagi sistem pemberian remunirasi 30% jika kinerja dosen tidak mencapai 100%, sehingga hal ini menimbulkan persepsi ketidakadilan terhadap sistem evaluasi kinerja yang digunakan.', '2025-06-13 04:46:44', '2025-06-13 04:49:22'),
(141, 7, NULL, 49, 'Pelu meningkatkan komunikasi dan transparansi informasi terkait status pencairan tunjangan sertifikasi dan remunirasi, termasuk menyampaikan secara proaktif jika terdapat perubahan atau keterlambatan serta perlu menjelaskan sistem dan kendala aktual yang terjadi dalam manajemen keuangan kampus, sehingga dapat membangun rasa saling pengertian dan kepercayaan.', 'Tingkat kepuasan dosen terhadap ketepatan pencairan gaji, tunjangan sertifikasi, dan remunerasi bulanan berada pada angka 60,00%, yang dikategorikan sebagai Cukup Puas dengan mutu layanan C (Kurang Baik). Meskipun sebagian besar pencairan gaji, tunjangan sertifikasi dan remunirasi berlangsung sesuai prosedur, akan tetapi  terdapat beberapa hal yang menjadi perhatian dosen, khususnya dalam aspek kepastian waktu pencairan tunjangan sertifikasi dan remunirasi yang terkadang mengalami keterlambatan atau tidak dapat dipastikan waktu pencairannya secara konsisten.', '2025-06-13 04:54:20', '2025-06-13 04:56:46'),
(142, 13, NULL, 13, 'Meningkatkan sarana dan prasarana penunjang baik secara kuantitas maupun kualitas, agar mampu memenuhi ekspektasi dosen secara lebih menyeluruh', 'Tingginya persentase kepuasan (73.75%	) dan tidak ada responden yang menjawab tidak memuaskan menunjukkan bahwa dosen secara umum menilai kualitas sarana dan prasarana penunjang dalam pelaksanaan tridarma perguruan tinggi sudah baik, dengan predikat puas. Meski demikian, tidak ada responden yang menyatakan sangat memuaskan. Hal ini dapat mengindikasikan bahwa masih terdapat ruang untuk peningkatan, khususnya dalam aspek kualitas dan kelengkapan sarana prasarana, baik dari segi kenyamanan, kemutakhiran teknologi, maupun dukungan langsung terhadap pelaksanaan tridarma perguruan tinggi.', '2025-06-13 05:31:05', '2025-06-13 05:34:03'),
(143, 13, NULL, 35, 'Untuk meningkatkan tingkat kepuasan, salah satu langkah yang bisa dilakukan adalah melakukan pemeriksaan secara berkala terhadap sarana dan prasarana guna memastikan bahwa fasilitas di area praktik dan laboratorium dalam keadaan baik dan lengkap. Perlu juga dilakukan perawatan rutin serta penggantian peralatan yang sudah tidak berfungsi. Selain itu, pihak terkait harus menjamin tersedianya fasilitas pendukung yang memadai, serta menjaga kebersihan dan kenyamanan ruang praktik.', 'Tidak ada responden yang menyatakan ketidakpuasan, dan seluruh responden memberikan penilaian positif, meskipun dalam tiga tingkat yang berbeda (cukup memuaskan, memuaskan, sangat memuaskan). Hal ini mencerminkan bahwa sarana dan prasarana di ruang praktek/laboratorium/dsb sudah cukup lengkap.', '2025-06-13 05:37:15', '2025-06-13 05:42:24'),
(144, 13, NULL, 51, 'Perlu dibuka ruang partisipasi melalui penyelenggaraan forum secara berkala serta disediakannya platform komunikasi online guna memungkinkan dosen berperan lebih aktif dalam mengemukakan kebutuhan akademik mereka.', 'Proses penyusunan rencana bisnis dan anggaran masih dilakukan secara tertutup dan belum melibatkan peran aktif dosen dalam pengambilan keputusan. Terbatasnya forum diskusi serta kurangnya saluran untuk menyampaikan aspirasi menyebabkan masukan dari dosen belum sepenuhnya terakomodasi dalam tahap perencanaan. Oleh karena itu, perlu dibuka ruang partisipasi melalui penyelenggaraan forum secara berkala serta disediakannya platform komunikasi online guna memungkinkan dosen berperan lebih aktif dalam mengemukakan kebutuhan akademik mereka.', '2025-06-13 05:46:24', '2025-06-13 05:46:52'),
(145, 13, NULL, 41, 'Perlu disediakan area parkir khusus bagi dosen untuk menghindari persaingan dengan mahasiswa, terutama saat jam sibuk. Fasilitas parkir juga perlu ditingkatkan dengan penambahan atap pelindung, marka yang jelas, serta perbaikan permukaan jalan yang rusak guna meningkatkan kenyamanan. Selain itu, pengelolaan dan pengawasan lapangan harus lebih dioptimalkan agar pemanfaatan lahan parkir berjalan efisien dan tertib. Dengan adanya langkah-langkah tersebut, fasilitas parkir diharapkan menjadi lebih nyaman dan efektif, sehingga dapat meningkatkan kepuasan dosen.', '73.75%\nSurvei menunjukkan tingkat kepuasan dosen terhadap fasilitas parkir adalah memuaskan. Meski tersedia, area parkir kurang nyaman dan efektif digunakan. Masalah utama meliputi tidak terpisahnya zona parkir dosen dan mahasiswa, fasilitas yang tidak memadai seperti minimnya penutup dan marka jelas, serta pengelolaan yang kurang tertib. Untuk itu, disarankan agar UPPS menyediakan zona parkir khusus dosen, memperbaiki infrastruktur parkir, serta meningkatkan pengawasan. Program Studi juga perlu melakukan survei berkala, memberikan edukasi kepada mahasiswa, dan berkolaborasi dalam penyusunan anggaran perbaikan fasilitas parkir untuk dimasukkan dalam rencana strategis universitas.', '2025-06-13 05:51:15', '2025-06-13 05:52:21'),
(146, 13, NULL, 48, 'Solusi yang perlu dipertahankan adalah melanjutkan transparansi dalam pemotongan gaji dan remunerasi seperti yang sudah berjalan. Slip gaji yang mencantumkan rincian jenis dan jumlah potongan secara jelas wajib diberikan secara rutin setiap bulan. Selain itu, sistem informasi kepegawaian sebaiknya terus dikembangkan agar memungkinkan dosen mengakses riwayat potongan secara mandiri dan real time.', 'Pelaksanaan pemotongan telah dilakukan secara transparan dan sesuai dengan aturan yang berlaku. Jenis serta besar pemotongan tercantum jelas dalam slip gaji yang diterima dosen setiap bulan, sehingga tidak menimbulkan kebingungan atau keraguan.', '2025-06-13 05:55:15', '2025-06-13 05:55:51'),
(147, 13, NULL, 9, 'Perlu dilakukan audit terhadap sarana prasarana, perbaikan fisik seperti peningkatan kenyamanan ruang tunggu, penambahan pendingin udara, serta pemasangan tanda navigasi yang jelas guna meningkatkan aksesibilitas dan kualitas layanan.', 'Dalam hal kecukupan aksesibilitas dan kualitas sarana prasarana layanan kesehatan, sebanyak 42 dari 99 responden menyatakan cukup memuaskan, sementara 5 responden menyatakan tidak memuaskan. Nilai butir sebesar 2.51 menunjukkan adanya ketidakpuasan terhadap kondisi fasilitas yang tersedia. ', '2025-06-13 06:07:38', '2025-06-13 06:07:54'),
(148, 13, NULL, 15, 'Diperlukan penyusunan prosedur layanan yang lebih transparan, pelatihan petugas untuk menjalankan SOP secara konsisten, serta sosialisasi kepada pengguna melalui media informasi agar proses layanan lebih jelas dan terstruktur.', 'Dari 100 responden, 42 merasa cukup memuaskan dan hanya 2 yang sangat memuaskan, dengan nilai butir 2.52. Hal ini menunjukkan perlunya penyederhanaan dan standarisasi alur layanan agar lebih efektif dan mudah dipahami oleh pengguna.', '2025-06-13 06:09:03', '2025-06-13 06:09:33'),
(149, 13, NULL, 20, 'Peningkatan kemampuan komunikasi dan keramahan petugas melalui pelatihan rutin, penerapan sistem antrian elektronik untuk mengurangi waktu tunggu, serta evaluasi langsung dari pengguna setelah layanan sebagai umpan balik untuk perbaikan berkelanjutan.', 'Sebanyak 41 dari 100 responden menyatakan cukup memuaskan, sedangkan 5 responden menyatakan tidak memuaskan. Nilai butir 2.53 menunjukkan bahwa responsivitas petugas masih belum optimal.', '2025-06-13 06:10:17', '2025-06-13 06:10:46'),
(150, 13, NULL, 23, 'Dilakukan pelatihan teknis dan interpersonal bagi petugas BK secara berkala, pengembangan sistem informasi pendukung layanan, serta monitoring kinerja petugas untuk memastikan konsistensi mutu layanan yang diberikan.', 'Peningkatan kemampuan komunikasi dan keramahan petugas melalui pelatihan rutin, penerapan sistem antrian elektronik untuk mengurangi waktu tunggu, serta evaluasi langsung dari pengguna setelah layanan sebagai umpan balik untuk perbaikan berkelanjutan.', '2025-06-13 06:23:16', '2025-06-13 06:23:34');
INSERT INTO `temuans` (`id`, `prodi_id`, `fakultas_id`, `indikator_id`, `solusi`, `temuan`, `created_at`, `updated_at`) VALUES
(151, 13, NULL, 8, 'Perlu dilakukan pembenahan fisik ruang BK seperti peningkatan kenyamanan dan privasi, penambahan fasilitas pendukung seperti internet dan meubel yang ergonomis, serta pengaturan jadwal layanan yang lebih fleksibel agar mudah diakses oleh mahasiswa.', 'Sebanyak 40 dari 100 responden menyatakan cukup memuaskan, sementara 6 responden menyatakan sangat memuaskan. Nilai butir sebesar 2.60 menunjukkan bahwa fasilitas BK sudah memadai, tetapi masih dapat dikembangkan untuk menciptakan suasana yang lebih nyaman dan mendukung.', '2025-06-13 06:24:26', '2025-06-13 06:24:42'),
(153, 3, NULL, 39, NULL, 'Berdasarkan hasil survei, tingkat kepuasan dosen terhadap kelengkapan sarana dan prasarana poliklinik tergolong cukup rendah, dengan nilai butir 2.65 (predikat \"Puas\"). Akar permasalahan kemungkinan disebabkan oleh keterbatasan fasilitas yang belum sepenuhnya memenuhi kebutuhan dosen, peralatan yang kurang memadai, serta kurangnya informasi terkait layanan dan jadwal praktik. Oleh karena itu, disarankan kepada UPPS untuk meningkatkan koordinasi dengan pengelola poliklinik dalam hal pengadaan dan pemeliharaan fasilitas, serta memperluas jam layanan. Sementara itu, Program Studi dapat berperan dalam mengidentifikasi kebutuhan dosen melalui survei internal dan menyosialisasikan informasi layanan secara lebih efektif.', '2025-06-15 01:34:11', '2025-06-15 01:34:11'),
(154, 3, NULL, 49, NULL, 'Tingkat kepuasan dosen terhadap ketepatan pencairan gaji, sertifikasi dosen, dan remunerasi setiap bulan menunjukkan nilai butir 2.67 dengan tingkat kepuasan 66,67% (predikat \"Puas\"). Capaian ini mengindikasikan masih terdapat permasalahan, seperti keterlambatan pencairan, kurangnya transparansi jadwal pembayaran. Untuk itu, disarankan kepada UPPS agar meningkatkan koordinasi dengan bagian keuangan dan SDM universitas guna memastikan pencairan dilakukan tepat waktu dan informasi disampaikan secara terbuka. Program Studi juga dapat membantu menyampaikan aspirasi dosen serta memfasilitasi jalur komunikasi yang lebih responsif antara dosen dan unit terkait.', '2025-06-15 01:37:06', '2025-06-15 01:37:06'),
(155, 3, NULL, 34, NULL, 'Tingkat kepuasan dosen terhadap fasilitas media pembelajaran di kelas seperti LCD, layar, dan sound system memperoleh nilai butir 2.70 dengan tingkat kepuasan 67,50% (predikat \"Puas\"). Nilai ini mencerminkan adanya kendala dalam ketersediaan atau kualitas sarana pendukung pembelajaran, seperti perangkat yang tidak berfungsi optimal, keterbatasan teknis, atau kurangnya pemeliharaan rutin. Untuk perbaikan, UPPS perlu memastikan pemutakhiran dan pemeliharaan berkala terhadap fasilitas media pembelajaran, serta menyediakan saluran pelaporan yang cepat jika terjadi kerusakan. Program Studi juga dapat berperan dalam menginventarisasi kebutuhan dosen terkait media pembelajaran dan menyampaikan rekomendasi kepada pihak pengelola fasilitas.', '2025-06-15 01:38:15', '2025-06-15 01:38:15'),
(156, 3, NULL, 35, NULL, 'Tingkat kepuasan dosen terhadap kelengkapan sarana ruang praktik/laboratorium/bengkel berada pada nilai 2.70 (67,50%, predikat \"Puas\"). Hal ini mengindikasikan masih adanya kekurangan alat atau fasilitas pendukung. UPPS disarankan untuk meningkatkan evaluasi dan pengadaan fasilitas, sementara Program Studi dapat mengidentifikasi kebutuhan dan menyusun usulan perbaikan secara berkala.', '2025-06-15 01:40:05', '2025-06-15 01:40:05'),
(157, 3, NULL, 41, NULL, 'Kepuasan dosen terhadap kelengkapan sarana dan prasarana tempat parkir memperoleh nilai 2.74 dengan tingkat kepuasan 68,42% (predikat \"Puas\"). Nilai ini menunjukkan masih adanya kendala seperti keterbatasan lahan, ketidakteraturan parkir, atau kurangnya fasilitas pendukung. UPPS disarankan untuk berkoordinasi dengan pihak pengelola fasilitas untuk menata ulang area parkir, sementara Program Studi dapat menyampaikan masukan pengguna untuk perbaikan tata kelola parkir yang lebih nyaman dan tertib.', '2025-06-15 01:43:17', '2025-06-15 01:43:17'),
(158, 3, NULL, 9, NULL, 'Hasil survei menunjukkan kepuasan mahasiswa terhadap aksesibilitas dan kualitas sarana prasarana layanan kesehatan masih rendah, dengan nilai 2.52 (63,06%, predikat \"Puas\"). Akar masalah diduga berasal dari keterbatasan fasilitas, antrean layanan yang panjang, serta kurangnya informasi dan akses mudah terhadap layanan kesehatan. UPPS disarankan untuk mendorong peningkatan kapasitas dan kualitas layanan bersama unit terkait, sementara Program Studi dapat membantu menyosialisasikan prosedur layanan dan menampung masukan mahasiswa secara berkala untuk perbaikan berkelanjutan.', '2025-06-15 01:46:16', '2025-06-15 01:46:16'),
(159, 3, NULL, 15, NULL, 'Kepuasan mahasiswa terhadap prosedur layanan kesehatan tergolong rendah dengan nilai 2.52 (63,12%, predikat \"Puas\"). Akar masalah kemungkinan terkait prosedur yang rumit, kurang jelas, atau lambat dalam pelaksanaannya. Untuk perbaikan, UPPS disarankan mendorong penyederhanaan alur layanan dan peningkatan kecepatan respon unit kesehatan. Program Studi dapat membantu menyebarluaskan informasi prosedur secara efektif dan menyalurkan aspirasi mahasiswa kepada pihak terkait.', '2025-06-15 01:47:48', '2025-06-15 01:47:48'),
(160, 3, NULL, 20, NULL, 'Kepuasan mahasiswa terhadap kesigapan petugas layanan kesehatan memperoleh nilai 2.57 (64,13%, predikat \"Puas\"). Nilai ini mencerminkan adanya keluhan terhadap respons petugas yang kurang cepat atau tidak proaktif. UPPS disarankan mendorong peningkatan pelatihan pelayanan prima bagi petugas, sementara Program Studi dapat menyalurkan umpan balik mahasiswa dan mendorong komunikasi yang lebih responsif antara pengguna dan penyedia layanan.', '2025-06-15 01:50:59', '2025-06-15 01:50:59'),
(161, 3, NULL, 27, NULL, 'Kepuasan mahasiswa terhadap kepedulian petugas dalam menerima keluhan layanan kesehatan mencatat nilai 2.59 (64,82%, predikat \"Puas\"). Rendahnya nilai ini mengindikasikan masih kurangnya empati atau perhatian petugas terhadap keluhan mahasiswa. UPPS disarankan memberikan pelatihan peningkatan sikap pelayanan berbasis empati, sementara Program Studi dapat memfasilitasi kanal pengaduan yang lebih terbuka dan memastikan keluhan mahasiswa ditindaklanjuti dengan baik.', '2025-06-15 01:52:44', '2025-06-15 01:52:44'),
(163, 3, NULL, 53, NULL, 'Hasil survei menunjukkan kepuasan mahasiswa terhadap ketersediaan dan kualitas sarana akademik (laboratorium, bengkel, perpustakaan, internet, ruang kelas) masih rendah, dengan nilai 2.60 (64,91%, predikat \"Puas\"). Akar masalah kemungkinan terkait fasilitas yang belum merata, kurang terawat, atau tidak memadai kapasitasnya. UPPS disarankan untuk melakukan evaluasi dan peningkatan sarana secara bertahap sesuai kebutuhan mahasiswa, sementara Program Studi dapat menginventarisasi dan menyampaikan prioritas perbaikan serta mendorong pemanfaatan fasilitas secara optimal.', '2025-06-15 01:54:55', '2025-06-15 01:54:55'),
(165, 8, NULL, 32, 'Perlu adanya kepastian pencairan remunerasi dosen', 'Meskipun secara umum tingkat kepuasan dosen berada pada kisaran 70% akan tetapi tidak adanya kepastian pencairan cukup mempengaruh penilaian dosen pada kriteria ini.', '2025-06-16 01:27:20', '2025-06-16 01:28:33'),
(166, 8, NULL, 49, 'Perlu adanya jadwal teratur pencairan remun', 'Ketepatan pencairan gaji, sertifikasi dosen dan remunerasi disetiap bulan (Assurance) berada pada angka 65%. Akan tetapi pencairan remunerasi tidak ada pasti dan cenderung sering terlambat.', '2025-06-16 01:30:27', '2025-06-16 01:30:59'),
(167, 8, NULL, 41, 'Perlu dibuatkan tempat parkir yang lebih memadai', 'Kelengkapan sarana dan prasarana tempat parkir berada di angka 67,5%. Hal ini disebabkan fasilitas parkir yang tidak memadai, lahan parkir tidak cukup serta tidak teratur', '2025-06-16 01:33:29', '2025-06-16 01:34:12'),
(168, 8, NULL, 47, 'ketepatan waktu pencairan diperlukan secara reguler dan teratur.', 'Ketepatan dalam pemberian insentif remunerasi sesuai dengan kinerja tergolong rendah dengan nilai 67,50%. Menurut rersponden, hal ini disebabkan karena tidak adanya ketepatan waktu pencairan. ', '2025-06-16 01:36:05', '2025-06-16 01:36:59'),
(169, 8, NULL, 51, 'Diperlukan sutu forum dimana dosen dapat terlibat dalam forum penyusunan anggaran', 'Proses penyusunan rencana bisnis dan anggaran  belum melibatkan peran aktif dosen dalam pengambilan keputusan.  Tidak adanya  forum bagi dosen untuk mengusulkan anggaran sesuai kebutuhan menyebabkan sering kebutuhan dosen dalam PBM, dan penelitian tidak terpenuhi.', '2025-06-16 01:43:38', '2025-06-16 01:44:39'),
(170, 8, NULL, 15, 'Untuk meningkatkan layanan kesehatan perlu adanya layanan kesehatan di setiap fakultas atau di setiap kampus', 'Tingkat kepuasan sebesar 68,95% menunjukkan bahwa pada umumnya  mahasiswa merasa bahwa prosedur layanan kesehatan di kampus berjalan dengan baik, baik dari segi kejelasan alur layanan,  Meskipun demikian, sebagian merasa belum puas karrena fasilitas kesehatan hanya ada di kampus 1.', '2025-06-16 03:08:17', '2025-06-16 03:09:01'),
(171, 8, NULL, 9, 'Perlu peningkatan fasilitas kesehatan dan pengadaan fasilitas kesehatan di setiap lokasi kampus', 'Hasil survei menunjukkan kepuasan mahasiswa terhadap aksesibilitas dan kualitas sarana prasarana layanan kesehatan masih rendah, dengan nilai69,77%, (Puas)  Meskipun pada umunya pus akan tetapi masih terdapat keterbatasan falilitas.', '2025-06-16 03:11:56', '2025-06-16 03:12:38'),
(172, 8, NULL, 20, 'Diperlukan adanya fasilitas dan petugas kesehatan yang siaga setiap hari', 'Dengan tingkat kepuasan sebesar 69.88, kesigapan petugas layanan kesehatan masih dianggap kurang memadai. pada atau keadaan darurat tidak ada petugas medis yang berjaga di kampus. ', '2025-06-16 03:15:23', '2025-06-16 03:15:53'),
(173, 8, NULL, 12, 'Perlu diadakan layanan BK disetiap fakultas', 'Kepuasan mahasiswa terhadap pelayanan petugas Bimbingan Konseling (BK) menunjukkan  angka 70,16%. Rendahnya nilai ini kemungkinan disebabkan kurangnya informasi ten tang fasilitas layanan ini. Layanan ini tidak ada di fakultas sehingga mahasiswa cenderungf merasa kelsulitan untuk berkonsultasi ke BK', '2025-06-16 03:19:47', '2025-06-16 03:20:09'),
(174, 8, NULL, 8, NULL, 'Kecukupan aksesibilitas dan kualitas sarana prasarana layanan BK ada diangka peuasan 70,54%. Tidak adanya nya fasilitas layanan BK difakultyas menyebabkan akses ke layanan beka cukup bermasalah.', '2025-06-16 03:23:44', '2025-06-16 03:23:44'),
(175, NULL, 3, 34, '- Melakukan pendataan dan audit menyeluruh terhadap kondisi fasilitas media di setiap kelas.\n\n- Menganggarkan peremajaan dan pengadaan ulang alat pembelajaran seperti LCD, layar proyektor, dan sound system.\n\n- Menjadwalkan pemeliharaan rutin (maintenance) untuk memastikan semua fasilitas berfungsi optimal.\n\n- Memberikan pelatihan teknis bagi dosen dan tenaga kependidikan untuk penggunaan dan perawatan alat.', '- Kondisi fasilitas media pembelajaran banyak yang tidak optimal (rusak, tidak tersedia, atau ketinggalan zaman).\n\n- Kurangnya pemeliharaan rutin terhadap alat-alat elektronik pembelajaran.\n\n- Distribusi fasilitas belum merata di seluruh ruang kelas.\n\n- Minimnya pelatihan dosen dalam mengoperasikan media pembelajaran yang tersedia.', '2025-06-16 03:28:14', '2025-06-16 03:28:50'),
(176, NULL, 3, 33, '- Melakukan evaluasi jumlah dan kapasitas ruang kelas berdasarkan jumlah mahasiswa dan kebutuhan program studi.\n\n- Mengalokasikan anggaran renovasi/perawatan berkala ruang kelas agar tetap layak pakai dan nyaman.\n\n- Mendesain ulang tata letak ruang kelas agar lebih ergonomis dan mendukung metode pembelajaran interaktif.\n\n- Menambahkan fasilitas penunjang seperti kipas angin, AC, stop kontak, dan pencahayaan yang memadai.', '-Jumlah ruang kelas tidak sebanding dengan jumlah mahasiswa atau program studi.\n\n- Kondisi fisik ruang kelas kurang terawat (ventilasi, pencahayaan, kebersihan, atau kenyamanan tempat duduk).\n\n- Desain ruang kelas tidak mendukung pembelajaran aktif atau kolaboratif.\n\n- Fasilitas penunjang ruang kelas terbatas (stop kontak, AC/kipas, papan tulis, dll).', '2025-06-16 03:30:59', '2025-06-16 03:32:02'),
(177, NULL, 3, 35, '- Melakukan inventarisasi dan evaluasi kelayakan alat praktik serta kebutuhan setiap program studi.\n\n- Mengalokasikan anggaran secara bertahap untuk pengadaan dan peremajaan peralatan laboratorium.\n\n- Menyusun jadwal praktik yang lebih efisien dan merata agar semua mahasiswa mendapat kesempatan yang setara.\n\n- Menjalin kerja sama dengan pihak industri atau lembaga eksternal untuk mendukung pemenuhan alat laboratorium modern.', '- Ketersediaan alat praktik/lab tidak lengkap atau tidak sesuai dengan kebutuhan praktikum.\n\n- Alat dan bahan praktik kurang terawat atau sudah usang.\n\n- Jumlah alat tidak mencukupi jumlah mahasiswa sehingga harus bergiliran dan mengurangi efektivitas praktik.\n\n- Kurangnya pembaruan peralatan sesuai perkembangan teknologi atau kurikulum terbaru.', '2025-06-16 03:35:11', '2025-06-16 03:35:43'),
(178, NULL, 3, 47, '- Melakukan review dan evaluasi mekanisme pemberian insentif berbasis kinerja secara berkala.\n\n- Meningkatkan transparansi penilaian kinerja dengan indikator yang jelas dan akuntabel.\n\n- Menyusun jadwal tetap dan konsisten untuk pencairan insentif, agar lebih terukur dan tepat waktu.\n\n- Mengadakan sosialisasi dan forum dialog terbuka antara manajemen dan civitas akademika terkait skema remunerasi.', '- Kurangnya transparansi dan sosialisasi sistem penilaian kinerja yang menjadi dasar pemberian insentif.\n\n- Proses penyaluran insentif yang lambat atau tidak tepat waktu.\n\n- Kesenjangan antara beban kerja dan insentif yang diterima, sehingga dianggap tidak proporsional.\n\n- Ketidaksesuaian antara persepsi dosen/pegawai dengan kebijakan manajemen dalam hal pemberian insentif.\n\n', '2025-06-16 03:37:49', '2025-06-16 03:38:24'),
(179, NULL, 3, 39, '- Melakukan pendataan dan pengadaan alat kesehatan secara berkala, terutama alat yang dibutuhkan mahasiswa.\n\n- Menambah jam operasional atau shift layanan, terutama saat jam sibuk perkuliahan.\n\n- Meningkatkan jumlah tenaga medis dan administrasi yang bertugas di poliklinik.\n\n- Melakukan sosialisasi dan promosi layanan poliklinik melalui media kampus agar mahasiswa mengetahui manfaat yang tersedia.', '- Beberapa fasilitas atau alat kesehatan belum lengkap atau mengalami kerusakan ringan.\n\n- Waktu pelayanan yang terbatas atau tidak sesuai dengan kebutuhan mahasiswa.\n\n- Kurangnya tenaga medis atau petugas yang standby secara optimal pada jam-jam sibuk.\n\n- Kurangnya sosialisasi atau informasi terkait layanan dan fasilitas yang tersedia di poliklinik.', '2025-06-16 03:39:40', '2025-06-16 03:40:13'),
(182, 5, NULL, 21, 'Tingkat kepuasan sebesar 56,25% dengan predikat \"Cukup Puas\" pada pertanyaan 5 dapat ditingkatkan, dengan cara sebagai berikut: (1) Evaluasi rutin, dimana UPPS/PS dapat membentuk tim khusus yang fokus terhadap urusan pengembangan dosen, lalu tim tersebut dapat melakukan survei kecil secara berkala untuk tahu kebutuhan dosen dan tingkat kepuasan setelah program; (2) Perbanyak program, dimana UPPS/PS terlebih dahulu melakukan pendataan setahun sekali sesuai dengan kebutuhan dosen tersebut, lalu menyusun rencana kegiatan pengembangan dosen dan membuat lebih banyak pelatihan, seminar, atau kerja sama dengan pihak lain untuk memberi pilihan lebih banyak dan sesuai dengan dosen tersebut; (3) Alokasi dana khusus, dimana UPPS/PS dapat mengalokasikan anggaran khusus untuk pelatihan, termasuk bantuan biaya atau hibah kompetitif atau memberikan insentif seperti pengurangan jam mengajar setelah mengikuti pelatihan', 'Hasil survei pada pertanyaan 5, memperoleh predikat \"Cukup Puas\" (tingkat kepuasan sebesar 56,25%), karena: (1) Kesempatan terbatas, dimana program pelatihan/seminar jarang atau tidak beragam, sehingga dosen merasa kurang mendapatkan peluang; dan (2) Dana kurang, dimana belum terdapat anggaran khusus atau bantuan finansial yang memadai untuk mendukung dosen untuk mengikuti pelatihan', '2025-06-18 07:59:02', '2025-06-18 08:00:00'),
(184, 20, NULL, 109, 'Pendataan cepat oleh Koordinator Program Studi: Dalam waktu dua minggu, masing-masing prodi melakukan pendataan kondisi fasilitas ruang kuliah (internet & proyektor)\n\nPengajuan perbaikan ringan ke Bagian Umum: Berdasarkan hasil pendataan, prodi menyusun daftar prioritas fasilitas yang rusak ringan (misalnya: kabel longgar, remote tidak berfungsi) untuk segera diajukan perbaikannya ke Bagian Umum fakultas menggunakan jalur pemeliharaan rutin.', 'Beberapa ruang kuliah di Fakultas Ilmu Pendidikan belum dilengkapi dengan koneksi internet yang stabil serta perangkat proyektor yang berfungsi dengan baik. Hal ini menghambat proses pembelajaran berbasis teknologi dan presentasi materi oleh dosen dan mahasiswa.', '2025-06-21 07:36:10', '2025-06-21 07:37:57'),
(185, 20, NULL, 90, 'Penerapan Jadwal Pemeliharaan Rutin\nKoordinator Sarana dan Prasarana Prodi menyusun dan menerapkan jadwal inspeksi ringan bulanan untuk ruang-ruang kuliah dan laboratorium, kemudian melaporkan hasilnya ke bagian umum fakultas setiap awal bulan.\n\nForm Laporan Kerusakan Cepat via Kotak Saran Fakultas dan Menghubungi Bagian Umum\nMengaktifkan sistem pelaporan mandiri melalui Kotak Saran Fakultas dan melaporkan ke Bagian Umum, sehingga setiap kerusakan atau kebutuhan perbaikan dapat dilaporkan secara cepat dan terdokumentasi otomatis.', 'Beberapa ruang kuliah dan laboratorium di Fakultas Ilmu Pendidikan menunjukkan kurangnya pemeliharaan berkala, seperti AC yang tidak dingin, kursi rusak, dan lampu redup. Kondisi ini berdampak pada kenyamanan dan efektivitas proses pembelajaran.', '2025-06-21 07:41:52', '2025-06-21 07:43:11'),
(186, 20, NULL, 111, NULL, 'Mahasiswa mengalami kendala dalam proses peminjaman ruang atau fasilitas (seperti proyektor atau aula) karena prosedur yang belum terdigitalisasi dan informasi jadwal penggunaan belum tersedia secara terbuka. Hal ini menyebabkan keterlambatan dan ketidakpastian dalam pelaksanaan kegiatan kemahasiswaan.\n\n', '2025-06-21 07:45:48', '2025-06-21 07:45:48'),
(187, 20, NULL, 33, NULL, 'Kondisi fisik ruang kelas dinilai tidak memadai oleh dosen, mencakup pencahayaan yang kurang, ventilasi buruk, dan beberapa meja/kursi rusak.', '2025-06-21 08:05:27', '2025-06-21 08:05:27'),
(188, 14, NULL, 32, 'Untuk menanggulangi permasalahan ini, pertama-tama perlu disusun dokumen kebijakan remunerasi yang komprehensif dan mudah diakses oleh seluruh dosen, mencakup komponen penilaian kinerja dan rumus perhitungan gaji. Selanjutnya, dibentuk tim evaluasi remunerasi yang melibatkan perwakilan dosen untuk meninjau dan mengusulkan perbaikan paket kompensasi secara berkala. Selain itu, adakan sesi sosialisasi rutin yang menjelaskan struktur remunerasi, kriteria penilaian, dan prosedur pengajuan kenaikan gaji. Terakhir, selenggarakan survei kepuasan dosen setiap semester untuk menampung masukan langsung dan melakukan penyesuaian kebijakan secara berkesinambungan.', 'Data menunjukkan bahwa aspek Empathyyaitu pemberian remunerasi yang jelas, adil, dan transparanmendapatkan skor rata-rata 2,50 dari empat responden, sehingga masuk kategori mutu C dengan tingkat kepuasan hanya 62,50 %. Distribusi jawaban yang merata pada kategori TM, CM, M, dan SM mencerminkan kebingungan dosen terhadap mekanisme remunerasi yang berlaku. Hasil ini juga mengindikasikan kinerja unit pelayanan pada dimensi ini masih Kurang Baik karena kebijakan kompensasi belum dirasakan adil oleh sebagian dosen. Temuan tersebut menggarisbawahi perlunya perbaikan transparansi dan kejelasan dalam menetapkan paket remunerasi agar semangat dan performa dosen dapat meningkat.', '2025-07-08 22:49:26', '2025-07-08 22:49:43'),
(189, 14, NULL, 16, 'Untuk solusi, pertama pastikan kriteria seleksi dan pemberhentian dosen terdokumentasi secara jelas dan tersedia dalam SOP yang mudah diakses oleh seluruh staf. Kedua, lakukan pelatihan berkala bagi tim HR dan komite seleksi untuk menjaga konsistensi dan objektivitas keputusan. Ketiga, terapkan transparansi dengan mempublikasikan jadwal serta hasil seleksi secara ringkas kepada kandidat yang terlibat. Terakhir, adakan survei evaluasi proses rekrutmen setiap tahun dan rapat tindak lanjut untuk menampung umpan balik, sehingga proses ini terus terasah dan sesuai kebutuhan lembaga.', 'Data menunjukkan bahwa aspek Reliabilitymeliputi proses rekrutmen, seleksi, dan pemberhentian dosenmendapatkan nilai rata-rata 3,00 dari lima responden, sehingga masuk mutu B dengan tingkat kepuasan 75,00 % dan predikat Puas. Sebagian besar responden (tiga orang) menilai prosedur ini memadai (M), satu orang menilai kurang memadai (CM), dan satu orang sangat memadai (SM), tanpa satupun yang memberi kategori tidak memadai (TM). Kinerja unit pelayanan dalam hal ini tercatat Baik, menandakan bahwa proses rekrutmen dan seleksi sudah berjalan sesuai harapan, meski masih ada ruang untuk perbaikan. Temuan ini mengindikasikan bahwa mekanisme sudah cukup andal, tetapi perlu dipertahankan dan ditingkatkan agar kepuasan dosen semakin meningkat.', '2025-07-08 22:53:44', '2025-07-08 22:53:59'),
(190, 14, NULL, 21, 'Untuk solusi, pertama-tama susun kerangka program pelatihan dan studi lanjut yang terjadwal jelas dan transparan, meliputi topik, jadwal, serta mekanisme pendaftaran. Kedua, bentuk tim koordinasi pengembangan karir yang melibatkan perwakilan dosen untuk merancang materi pelatihan sesuai kebutuhan aktual. Ketiga, adakan sosialisasi berkala tentang jenis dan manfaat pelatihan, serta siapkan portal online untuk memudahkan pendaftaran dan pelaporan hasil. Terakhir, laksanakan evaluasi program setiap semester melalui survei umpan balik dosen dan tindak lanjuti hasilnya dengan perbaikan berkelanjutan.', 'Data menunjukkan bahwa aspek Responsivenessyaitu pemberian kesempatan mengembangkan karir melalui pelatihan, seminar, atau studi lanjutmendapatkan nilai rata-rata 3,00 dari empat responden sehingga masuk mutu B dengan tingkat kepuasan 75,00 %. Dua responden menilai pelayanan cukup memadai (CM) dan dua lainnya sangat memadai (SM), tanpa satupun yang menilai kurang memadai. Kinerja unit pelayanan tercatat Baik, mengindikasikan bahwa program pengembangan karir sudah berjalan, tetapi masih ada ruang peningkatan. Temuan ini menegaskan bahwa meski sarana pelatihan tersedia, efektivitas dan aksesibilitasnya perlu terus diperbaiki agar semakin menyeluruh.', '2025-07-08 22:54:55', '2025-07-08 22:55:21'),
(191, 14, NULL, 33, 'Untuk meningkatkan kepuasan, lakukan audit menyeluruh terhadap kondisi ruang kelasmulai dari pencahayaan dan ventilasi hingga kursi dan kebersihanlalu perbarui elemen yang rusak atau kurang layak. Terapkan jadwal pemeliharaan rutin dengan inspeksi berkala dan tindakan perbaikan kecil sebelum menimbulkan kerusakan serius. Libatkan perwakilan dosen dalam tim evaluasi dan perencanaan perbaikan agar masukan langsung dari pengguna terakomodasi. Setelah perbaikan dilakukan, adakan survei susulan pada semester berikutnya untuk memastikan peningkatan kualitas dan menindaklanjuti masukan lebih lanjut.', 'Data menunjukkan bahwa aspek Tangible berupa kelayakan ruang kelas memperoleh nilai rata-rata 2,80 (mutu B) dengan tingkat kepuasan 70,00 %. Dari lima responden, satu menilai tidak memadai, satu cukup memadai, satu memadai, dan dua sangat memadai, mencerminkan variasi persepsi mengenai kondisi fisik ruang. Kinerja unit pelayanan tercatat Baik dan predikat Puas, menandakan bahwa sebagian besar dosen merasa fasilitas ruang kelas sudah memadai. Namun, adanya satu responden yang memberi nilai tidak memadai menunjukkan bahwa masih terdapat kekurangan pada aspek seperti pencahayaan, ventilasi, atau kebersihan ruang.', '2025-07-08 22:57:32', '2025-07-08 22:57:50'),
(192, 14, NULL, 34, 'Sebagai solusi, langkah pertama adalah melakukan inventarisasi lengkap terhadap semua perangkat media pembelajaran dan mengganti atau memperbaiki unit yang usang atau sering bermasalah. Kedua, terapkan jadwal pemeliharaan rutintermasuk kalibrasi proyektor, pengecekan kabel, dan pembersihan speakeragar downtime diminimalkan. Ketiga, sediakan stok cadangan untuk komponen penting seperti kabel HDMI, remote kontrol, dan lampu proyektor sehingga kerusakan tidak langsung menghentikan kegiatan mengajar. Terakhir, adakan pelatihan singkat bagi teknisi dan petugas ruang serta sosialisasi prosedur peminjaman dan pelaporan kerusakan, lalu lakukan evaluasi ulang kepuasan dosen di semester berikutnya untuk memastikan perbaikan berjalan efektif.', 'Data survei menunjukkan bahwa fasilitas media pembelajaran di kelastermasuk LCD, layar proyektor, dan sound systemmendapatkan nilai rata-rata 3,00 (mutu B) dengan tingkat kepuasan 75,00 % dari lima responden. Tidak ada responden yang memberi kategori tidak memadai, tetapi dua dosen hanya menilai cukup memadai, satu memadai, dan dua sangat memadai, menandakan kebanyakan merasa fasilitas sudah layak meski konsistensi layanannya terkadang kurang. Kinerja unit pelayanan tercatat Baik dan predikat Puas, namun adanya penilaian cukup memadai mengindikasikan masih ada gangguan teknis atau ketersediaan alat yang terbatas. Temuan ini menggarisbawahi perlunya peningkatan keandalan dan ketersediaan perangkat media pembelajaran supaya semua dosen dapat mengajar tanpa hambatan.', '2025-07-08 22:58:51', '2025-07-08 22:59:18'),
(193, 14, NULL, 15, 'Perlu meninjau kembali SOP prosedur layanan kesehatan dengan melibatkan perwakilan mahasiswa dan tenaga medis untuk memastikan kejelasan. Lakukan sosialisasi ulang alur layanan beserta persyaratan yang terstandardisasi melalui workshop dan materi digital. Selenggarakan pelatihan kepatuhan SOP bagi petugas secara berkala untuk menjaga konsistensi pelaksanaan. Terakhir, terapkan monitoring dan evaluasi internal tiap kuartal untuk menindaklanjuti temuan dan menjamin peningkatan berkelanjutan.', 'Data menunjukkan bahwa prosedur layanan kesehatan (Reliability) memiliki rata-rata nilai butir 2,73 dari 22 responden sehingga mutu layanan masuk B, dengan tingkat kepuasan 68,18 % dan predikat Puas. Sebanyak 1 responden menilai tidak memadai, 6 cukup memadai, 13 memadai, dan 2 sangat memadai, mencerminkan variasi persepsi tentang keandalan alur layanan. Kinerja unit pelayanan tercatat Baik, namun kepuasan masih di bawah 70 %, menunjukkan masih ada ruang untuk penyempurnaan. Temuan ini mengindikasikan perlunya penajaman prosedur dan klarifikasi alur layanan kesehatan agar harapan mahasiswa terpenuhi.', '2025-07-08 23:01:09', '2025-07-08 23:01:26'),
(194, 14, NULL, 23, 'Tingkatkan program pelatihan teknis dan interpersonal bagi petugas BK untuk memperkuat kompetensi dan keramahan layanan. Standarisasi kualifikasi melalui sertifikasi internal yang wajib diperbarui setiap tahun. Fasilitasi program mentorship antara petugas senior dan junior agar transfer pengetahuan berjalan sistematis. Gunakan umpan balik mahasiswa sebagai dasar penilaian kinerja dan rancang modul pelatihan lanjutan sesuai hasil evaluasi.', 'Aspek Assurance pada kemampuan petugas BK memperoleh rata-rata nilai butir 2,74 dari 23 responden sehingga mutu layanan B dengan tingkat kepuasan 68,48 % dan predikat Puas. Distribusi jawaban menunjukkan 1 responden tidak memadai, 7 cukup memadai, 12 memadai, dan 3 sangat memadai, mencerminkan kepercayaan mahasiswa yang masih beragam. Kinerja unit pelayanan tercatat Baik, namun kepuasan di bawah 70 % menandakan keraguan tentang kompetensi petugas. Temuan ini menggarisbawahi kebutuhan memperkuat standar keahlian dan sikap profesional petugas BK.', '2025-07-08 23:02:01', '2025-07-08 23:02:18'),
(195, 14, NULL, 19, 'Untuk mempercepat respons, perbaiki sistem antrian dan prioritas layanan dengan menetapkan waktu tunggu maksimal yang transparan. Terapkan pelaporan waktu tanggap dan target Service Level Agreement (SLA) yang dipublikasikan ke mahasiswa. Latih petugas dalam manajemen waktu dan penggunaan sistem informasi manajemen untuk mempercepat proses administrasi. Lakukan evaluasi data responsivitas secara rutin guna mengidentifikasi hambatan dan merumuskan tindakan korektif.\n\n', 'Aspek Responsiveness yang mengukur kecepatan petugas BK dalam membantu mahasiswa mencatat nilai rata-rata 2,82 dari 22 responden sehingga termasuk mutu B dengan tingkat kepuasan 70,45 % dan predikat Puas. Dari distribusi jawaban, 8 responden menilai cukup memadai, 10 memadai, dan 4 sangat memadai, tanpa satupun menilai tidak memadai. Kinerja unit pelayanan tercatat Baik, menunjukkan responsivitas yang relatif lebih tinggi dibanding dimensi lain. Meski demikian, masih terdapat 8 responden yang merasa layanan bisa lebih cepat lagi.', '2025-07-08 23:02:59', '2025-07-08 23:03:16'),
(196, 14, NULL, 9, 'Lakukan inventarisasi lengkap dan upgrade fasilitas seperti ruang tunggu, peralatan medis, dan aksesibilitas difabel agar standar terpenuhi. Jadwalkan pemeliharaan rutintermasuk pembersihan, pengecatan, dan pengecekan teknissebagai bagian dari SOP. Sediakan jalur evakuasi dan fasilitas pendukung lain sesuai regulasi keselamatan. Buat survei kepuasan periodik serta rapat tindak lanjut untuk menyesuaikan perbaikan dengan kebutuhan pengguna.', 'Aspek Tangible terkait sarana prasarana layanan kesehatan memperoleh nilai rata-rata 2,83 dari 23 responden sehingga mutu layanan B dengan tingkat kepuasan 70,65 % dan predikat Puas. Distribusi mencakup 2 responden tidak memadai, 5 cukup memadai, 11 memadai, dan 5 sangat memadai, mencerminkan mayoritas puas tetapi sebagian kecil masih merasakan kekurangan. Kinerja unit pelayanan tercatat Baik, namun adanya penilaian tidak memadai menunjukkan kebutuhan perbaikan fasilitas fisik. Temuan ini menegaskan perlunya upgrade dan pemeliharaan rutin pada prasarana layanan kesehatan.', '2025-07-08 23:04:12', '2025-07-08 23:04:37'),
(197, 14, NULL, 10, 'Audit sarana organisasi kemahasiswaan untuk mengidentifikasi kebutuhan ruang UKM, peralatan event, dan gudang penyimpanan. Sediakan sistem peminjaman online dengan transparansi ketersediaan dan prosedur yang mudah diakses. Perkuat anggaran dan jalin kerjasama sponsor atau mitra untuk pembaruan peralatan penting. Lakukan evaluasi kepuasan anggota organisasi setiap semester untuk memastikan perbaikan selaras dengan harapan pengguna.', 'Aspek Tangible pada sarana prasarana organisasi kemahasiswaan menunjukkan nilai rata-rata 2,83 dari 23 responden sehingga masuk mutu B dengan tingkat kepuasan 70,65 % dan predikat Puas. Dari survei, 1 responden menilai tidak memadai, 7 cukup memadai, 10 memadai, dan 5 sangat memadai, mencerminkan sebagian besar merasa fasilitas memadai namun beberapa masih membutuhkan perbaikan. Kinerja unit pelayanan tercatat Baik, namun evaluasi menunjukkan perlunya pembaruan sarana guna mendukung aktivitas kemahasiswaan. Temuan ini mendorong upaya peningkatan kualitas dan ketersediaan fasilitas organisasi.', '2025-07-08 23:05:23', '2025-07-08 23:05:35'),
(198, NULL, 3, 109, NULL, 'Perlu dilakukan Pemeliharaan dan pengelolaan sarana dan prasarana akademis', '2025-08-29 05:39:08', '2025-08-29 05:39:08'),
(199, 71, NULL, 4, 'Berdasarkan hasil survei kepuasan dosen tahun 2024 terhadap layanan manajemen UNG yang menunjukkan tingkat kepuasan sangat tinggi namun masih memiliki ruang peningkatan, beberapa solusi strategis dapat dilakukan untuk mempertahankan sekaligus meningkatkan kualitas layanan. Pertama, optimalisasi sistem layanan digital perlu menjadi prioritas, terutama dalam meningkatkan kecepatan respons dan stabilitas akses pada sistem daring seperti portal administrasi dan akademik. Hal ini dapat dilakukan melalui peningkatan kapasitas server, pembaruan perangkat lunak secara berkala, serta penerapan sistem monitoring kinerja digital agar gangguan dapat segera terdeteksi dan diatasi. Kedua, integrasi antar sistem informasi di seluruh unit manajemen perlu diperkuat agar data dosen dapat terhubung secara otomatis dan menghindari pengisian berulang pada berbagai platform. Langkah ini tidak hanya mempercepat proses administrasi, tetapi juga meningkatkan efisiensi dan konsistensi data lintas unit.\n\nSelanjutnya, peningkatan kompetensi staf pelayanan dan pengguna layanan menjadi faktor penting. Diperlukan program pelatihan rutin bagi petugas administrasi dalam hal pelayanan prima (service excellence), manajemen aduan, dan penggunaan sistem informasi terbaru. Di sisi lain, dosen sebagai pengguna layanan juga dapat difasilitasi dengan pelatihan teknis dan panduan digital untuk memaksimalkan pemanfaatan sistem daring secara mandiri. Keempat, perlu dibangun mekanisme feedback berkelanjutan yang memungkinkan dosen memberikan masukan secara langsung melalui survei mini atau fitur penilaian cepat setelah menggunakan layanan tertentu. Data ini dapat menjadi dasar evaluasi real-time untuk perbaikan sistem dan peningkatan kualitas pelayanan.\n\nTerakhir, penguatan budaya pelayanan dan komunikasi internal di lingkungan manajemen UNG sangat penting. Koordinasi lintas unit perlu dijaga agar setiap permintaan atau keluhan dosen dapat ditangani secara cepat dan tuntas melalui sistem tindak lanjut terpadu. Dengan menerapkan langkah-langkah tersebut secara konsisten, diharapkan layanan manajemen UNG tidak hanya mempertahankan predikat Sangat Baik tetapi juga mencapai standar pelayanan unggul yang adaptif terhadap perkembangan teknologi dan kebutuhan sivitas akademika.', 'Berdasarkan hasil Survei Kepuasan Dosen Tahun 2024 terhadap Layanan Manajemen Universitas Negeri Gorontalo, butir instrumen nomor 2 yang menilai ketersediaan layanan dalam menunjang kegiatan tridarma perguruan tinggi, administrasi, dan kebutuhan informasi secara online maupun offline dengan akurat dan memuaskan (reliability) memperoleh nilai rata-rata 3,67 dari total 12 responden. Mutu layanan berada pada kategori A dengan kinerja unit pelayanan dinilai sangat baik, tingkat kepuasan mencapai 91,67%, dan predikat keseluruhan menunjukkan kategori sangat puas. Hasil ini mengindikasikan bahwa layanan manajemen UNG telah memiliki tingkat keandalan yang tinggi dalam mendukung pelaksanaan tridarma dosen. Sistem administrasi dan layanan informasi yang tersedia, baik daring maupun luring, dinilai efektif, akurat, dan mampu memenuhi kebutuhan dosen secara optimal. Mayoritas responden menilai bahwa proses pelayanan berlangsung cepat, mudah diakses, dan jarang mengalami kendala teknis, mencerminkan bahwa unit manajemen telah menerapkan standar kerja yang berorientasi pada kepuasan pengguna layanan. Meskipun demikian, masih terdapat ruang untuk peningkatan, terutama pada aspek optimalisasi kecepatan respons layanan online dan integrasi sistem informasi lintas unit agar proses administrasi lebih efisien. Selain itu, kegiatan sosialisasi dan pelatihan teknis bagi dosen baru perlu terus diperkuat agar seluruh pengguna dapat memanfaatkan layanan digital secara maksimal. Secara keseluruhan, hasil survei ini menunjukkan bahwa layanan manajemen UNG pada aspek keandalan (reliability) telah berjalan sangat baik dan memuaskan, dengan rekomendasi untuk terus menjaga serta meningkatkan kualitas pelayanan melalui penguatan sistem digital dan peningkatan kapasitas responsivitas layanan.', '2025-10-28 06:24:51', '2025-10-28 06:25:51'),
(200, 71, NULL, 29, 'Untuk meningkatkan kualitas dan transparansi mekanisme evaluasi kinerja dosen di Universitas Negeri Gorontalo, diperlukan beberapa langkah strategis yang terintegrasi dan berkelanjutan. Pertama, perlu ditingkatkan keterbukaan informasi hasil evaluasi dengan cara menyampaikan hasil penilaian kepada dosen secara personal dan disertai umpan balik konstruktif. Hal ini penting agar setiap dosen dapat memahami kekuatan dan aspek yang masih perlu diperbaiki sebagai dasar pengembangan diri dan peningkatan kinerja tridarma. Kedua, indikator dan instrumen penilaian kinerja perlu distandardisasi dan disosialisasikan secara menyeluruh, sehingga proses evaluasi menjadi lebih objektif, terukur, dan dapat diterima oleh semua pihak. Ketiga, pengembangan sistem digital berbasis daring untuk evaluasi kinerja perlu segera diimplementasikan guna mempermudah proses pengisian data, verifikasi, serta pelaporan hasil penilaian secara cepat, akurat, dan akuntabel.\n\nSelain itu, komunikasi dan pendampingan kepada dosen juga harus diperkuat melalui forum refleksi atau sesi coaching rutin yang memberikan kesempatan untuk klarifikasi hasil evaluasi dan membangun budaya evaluatif yang positif. Unit manajemen dan lembaga penjaminan mutu perlu berkolaborasi dalam memastikan mekanisme evaluasi tidak hanya bersifat administratif, tetapi juga berorientasi pada peningkatan kualitas tridarma perguruan tinggi. Dengan langkah-langkah tersebut, sistem evaluasi kinerja dosen di UNG diharapkan menjadi lebih transparan, adil, dan bermanfaat dalam mendorong profesionalisme dosen serta peningkatan mutu institusi secara keseluruhan.', 'Berdasarkan hasil Survei Kepuasan Dosen Tahun 2024 terhadap layanan manajemen UNG pada aspek Assurance (jaminan kepercayaan), khususnya terkait evaluasi kinerja dosen yang dilakukan melalui mekanisme yang transparan, diperoleh nilai rata-rata 3,58 dari 12 responden dengan mutu layanan kategori A (Sangat Baik), tingkat kepuasan sebesar 89,58%, dan predikat Sangat Puas. Hasil ini menunjukkan bahwa sebagian besar dosen menilai proses evaluasi kinerja telah berjalan baik dan relatif transparan. Dosen merasa bahwa mekanisme penilaian kinerja sudah memiliki prosedur yang jelas dan terstandar. Namun, tingkat kepuasan yang masih di bawah 90% mengindikasikan adanya ruang perbaikan, terutama dalam hal kejelasan indikator penilaian, keterbukaan hasil evaluasi, dan komunikasi tindak lanjut hasil penilaian kepada dosen secara merata.', '2025-10-28 06:27:56', '2025-10-28 06:28:49'),
(201, 71, NULL, 11, 'Untuk meningkatkan kualitas layanan pada aspek aksesibilitas sistem informasi dosen, beberapa solusi dapat dilakukan. Pertama, perlu dilakukan optimalisasi infrastruktur teknologi informasi, seperti peningkatan kapasitas server, pemeliharaan sistem secara berkala, serta penanganan cepat terhadap gangguan teknis agar sistem tetap stabil dan mudah diakses kapan pun. Kedua, integrasi lintas platform antara SISTER, SIAT, dan sistem pendukung lainnya perlu diperkuat agar data dosen dapat tersinkronisasi otomatis tanpa harus menginput data yang sama di berbagai sistem. Ketiga, penyempurnaan antarmuka pengguna (user interface) dan peningkatan kecepatan pemrosesan data juga penting agar pengalaman pengguna lebih efisien dan nyaman. Keempat, universitas dapat menyediakan pusat bantuan digital atau layanan dukungan pengguna (helpdesk) berbasis daring yang responsif untuk membantu dosen ketika mengalami kesulitan teknis. Dengan menerapkan langkah-langkah tersebut, diharapkan sistem informasi kinerja dosen di UNG akan semakin handal, efisien, dan berkelanjutan dalam mendukung pelaksanaan tridarma perguruan tinggi secara digital dan terintegrasi.', 'Berdasarkan hasil Survei Kepuasan Dosen Tahun 2024 terhadap layanan manajemen Universitas Negeri Gorontalo pada aspek Tangibles (bukti fisik), khususnya mengenai aksesibilitas dan kemudahan dalam mengakses sistem informasi kinerja dosen seperti SISTER, SIAT, dan platform lainnya, diperoleh nilai rata-rata sebesar 3,67 dari total 12 responden. Mutu layanan berada pada kategori A (Sangat Baik), dengan kinerja unit pelayanan dinilai sangat baik, tingkat kepuasan mencapai 91,67%, dan predikat keseluruhan sangat puas. Hasil ini menunjukkan bahwa mayoritas dosen merasa sistem informasi yang disediakan oleh universitas sudah mudah diakses, memiliki tampilan yang cukup jelas, serta mendukung kebutuhan pelaporan kinerja dosen secara efektif. Namun demikian, meskipun tingkat kepuasan sudah sangat tinggi, masih terdapat potensi peningkatan terutama pada aspek stabilitas sistem, kecepatan akses, dan integrasi data antar platform digital yang digunakan.', '2025-10-28 06:30:36', '2025-10-28 06:30:47'),
(202, 71, NULL, 16, 'Untuk meningkatkan kualitas layanan pada aspek ini, universitas dapat memperkuat sistem informasi kepegawaian berbasis digital yang menyediakan akses publik terhadap jadwal, tahapan, dan hasil seleksi dosen secara lebih transparan. Selain itu, diperlukan penyelarasan standar rekrutmen dan evaluasi kinerja dosen di seluruh fakultas agar pelaksanaannya seragam dan berkeadilan. Proses pemberhentian dosen juga perlu dilaksanakan secara profesional dengan memperhatikan prosedur hukum dan etika akademik yang berlaku. Selanjutnya, peningkatan kapasitas tim seleksi dan verifikasi administrasi melalui pelatihan dan pembekalan teknis dapat membantu mempercepat proses dan meminimalkan potensi kesalahan. Terakhir, UNG dapat membentuk forum komunikasi dan evaluasi tahunan antara pihak manajemen dan dosen untuk menampung masukan terkait mekanisme rekrutmen dan pemberhentian. Dengan langkah-langkah tersebut, diharapkan sistem rekrutmen dan manajemen dosen di UNG semakin akuntabel, efisien, dan berorientasi pada peningkatan mutu sumber daya manusia perguruan tinggi.', 'Berdasarkan hasil Survei Kepuasan Dosen Tahun 2024 terhadap layanan manajemen Universitas Negeri Gorontalo pada aspek Reliability yang menilai proses rekrutmen, seleksi, dan pemberhentian dosen, diperoleh nilai rata-rata sebesar 3,67 dari total 12 responden, dengan mutu layanan berkategori A (Sangat Baik), kinerja unit pelayanan sangat baik, tingkat kepuasan 91,67%, dan predikat keseluruhan sangat puas. Hasil ini menunjukkan bahwa mayoritas dosen menilai mekanisme rekrutmen dan seleksi dosen di UNG telah berjalan dengan baik, mengikuti prosedur yang transparan, dan sesuai dengan ketentuan yang berlaku. Prosesnya dianggap cukup terbuka, objektif, serta memperhatikan kualifikasi dan kompetensi calon dosen. Namun demikian, nilai kepuasan yang belum mencapai 100% mengindikasikan bahwa masih terdapat ruang perbaikan, khususnya dalam hal peningkatan transparansi informasi, percepatan proses administrasi, dan konsistensi penerapan standar seleksi antar fakultas.', '2025-10-28 06:33:06', '2025-10-28 06:33:44'),
(203, 71, NULL, 18, 'Untuk meningkatkan kualitas layanan pada aspek ini, universitas dapat memperkuat digitalisasi sistem kenaikan pangkat dengan membangun platform terpadu yang memungkinkan dosen memantau secara langsung status pengajuan dan perkembangan berkasnya. Selain itu, perlu dilakukan penyederhanaan alur administrasi dan penguatan koordinasi antarunit agar proses penilaian berjalan lebih cepat dan bebas dari duplikasi tahapan. Unit kepegawaian juga dapat memperkuat layanan konsultasi dan pendampingan dosen melalui klinik kenaikan pangkat atau helpdesk daring yang responsif terhadap pertanyaan dan kendala administratif. Di samping itu, peningkatan kompetensi staf administrasi melalui pelatihan regulasi terbaru dan manajemen dokumen digital perlu dilakukan agar pelayanan semakin profesional. Dengan langkah-langkah tersebut, proses kenaikan pangkat dosen di UNG diharapkan menjadi lebih cepat, transparan, dan akuntabel, sekaligus mendukung peningkatan motivasi dan kinerja akademik para dosen.', 'Berdasarkan hasil Survei Kepuasan Dosen Tahun 2024 terhadap layanan manajemen Universitas Negeri Gorontalo pada aspek Responsiveness yang menilai kemudahan dalam proses kenaikan pangkat dosen, diperoleh nilai rata-rata sebesar 3,67 dari total 12 responden, dengan mutu layanan A (Sangat Baik), kinerja unit pelayanan sangat baik, tingkat kepuasan 91,67%, dan predikat keseluruhan sangat puas. Hasil ini menunjukkan bahwa secara umum proses kenaikan pangkat dosen di UNG telah berjalan dengan baik dan efisien. Dosen merasa bahwa layanan yang diberikan oleh unit kepegawaian cukup responsif, prosedur pengajuan kenaikan pangkat sudah jelas, serta komunikasi antar pihak berjalan lancar. Meskipun demikian, masih terdapat ruang untuk peningkatan terutama pada aspek kecepatan verifikasi berkas, konsistensi penerapan aturan, dan keterbukaan informasi mengenai tahapan proses penilaian angka kredit.', '2025-10-28 06:35:05', '2025-10-28 06:35:24'),
(204, 71, NULL, 26, 'Meskipun demikian, untuk mempertahankan dan meningkatkan kualitas layanan, terdapat beberapa solusi yang dapat dilakukan. Pertama, peningkatan kompetensi interpersonal dan komunikasi empatik bagi petugas BK melalui pelatihan lanjutan, agar kualitas interaksi konseling semakin mendalam dan personal. Kedua, universitas dapat mengembangkan sistem penjadwalan dan tindak lanjut konseling berbasis digital, sehingga mahasiswa lebih mudah mengakses layanan kapan pun dibutuhkan tanpa kendala waktu atau tempat. Ketiga, perlu dilakukan penguatan pendekatan konseling preventif, bukan hanya kuratif, dengan cara menyelenggarakan kegiatan sosialisasi, seminar, dan program kesejahteraan mental mahasiswa secara rutin. Selain itu, peningkatan jumlah dan ketersediaan petugas konselor profesional juga penting agar rasio konselor terhadap jumlah mahasiswa lebih proporsional, sehingga layanan dapat diberikan secara optimal. Dengan langkah-langkah tersebut, layanan konseling di UNG diharapkan semakin responsif, humanis, dan berdaya guna dalam mendukung kesejahteraan serta perkembangan akademik dan psikologis mahasiswa.', 'Berdasarkan hasil Survei Kepuasan Mahasiswa Tahun 2024 terhadap layanan kemahasiswaan Universitas Negeri Gorontalo pada aspek Empathy, khususnya terkait komunikasi petugas BK saat memberikan konseling, diperoleh nilai rata-rata sebesar 3,76 dari total 21 responden. Mutu layanan dikategorikan A (Sangat Baik), kinerja unit pelayanan dinilai sangat baik, dengan tingkat kepuasan mencapai 94,05% dan predikat keseluruhan sangat puas. Hasil ini menunjukkan bahwa mahasiswa menilai petugas Bimbingan dan Konseling (BK) memiliki kemampuan komunikasi yang baik, mampu menunjukkan empati, serta menciptakan suasana konseling yang nyaman dan mendukung. Hal ini mencerminkan bahwa layanan konseling telah dijalankan secara profesional dengan memperhatikan kebutuhan emosional dan psikologis mahasiswa.', '2025-10-28 06:37:01', '2025-10-28 06:37:13'),
(205, 71, NULL, 22, 'Meskipun capaian kepuasan sudah sangat tinggi, peningkatan kualitas layanan tetap perlu dilakukan agar kesigapan organisasi kemahasiswaan semakin optimal. Pertama, perlu dilakukan penguatan kapasitas pengurus organisasi kemahasiswaan melalui pelatihan kepemimpinan, manajemen pelayanan publik, serta komunikasi efektif agar setiap anggota organisasi dapat memberikan layanan yang cepat dan profesional. Kedua, pemanfaatan teknologi informasi seperti penggunaan sistem pengaduan dan respons cepat berbasis daring dapat mempercepat penyampaian dan penanganan aspirasi mahasiswa. Ketiga, universitas dapat memperkuat koordinasi antara biro kemahasiswaan dan organisasi mahasiswa agar setiap kegiatan maupun permasalahan dapat ditangani secara kolaboratif dan tepat waktu. Selain itu, perlu dikembangkan mekanisme evaluasi berkala untuk memantau kinerja organisasi kemahasiswaan dan menilai efektivitas respons terhadap kebutuhan mahasiswa. Dengan langkah-langkah tersebut, diharapkan kesigapan organisasi kemahasiswaan UNG dalam memberikan layanan akan semakin meningkat, konsisten, dan berkontribusi positif terhadap kesejahteraan serta pengembangan potensi mahasiswa.', 'Berdasarkan hasil Survei Kepuasan Mahasiswa Tahun 2024 terhadap layanan kemahasiswaan Universitas Negeri Gorontalo pada aspek Responsiveness, khususnya terkait kesigapan organisasi kemahasiswaan dalam melayani mahasiswa, diperoleh nilai rata-rata sebesar 3,80 dari total 20 responden. Mutu layanan berada pada kategori A (Sangat Baik), dengan kinerja unit pelayanan dinilai sangat baik, tingkat kepuasan mencapai 95,00%, dan predikat keseluruhan sangat puas. Hasil ini menunjukkan bahwa mahasiswa menilai organisasi kemahasiswaan di UNG sudah memiliki tingkat responsivitas yang tinggi dalam memberikan layanan, baik dalam hal komunikasi, penanganan kebutuhan mahasiswa, maupun pelaksanaan kegiatan kemahasiswaan. Organisasi kemahasiswaan dinilai sigap, kooperatif, dan cepat dalam merespons berbagai permasalahan atau kebutuhan mahasiswa, baik akademik maupun non-akademik.', '2025-10-28 06:38:38', '2025-10-28 06:38:50');
INSERT INTO `temuans` (`id`, `prodi_id`, `fakultas_id`, `indikator_id`, `solusi`, `temuan`, `created_at`, `updated_at`) VALUES
(206, 71, NULL, 9, 'Meskipun hasil survei menunjukkan tingkat kepuasan yang sangat tinggi, beberapa langkah strategis tetap dapat dilakukan untuk menjaga dan meningkatkan kualitas layanan. Pertama, universitas dapat melakukan peningkatan kualitas dan pemeliharaan fasilitas kesehatan secara berkala, seperti penyediaan peralatan medis modern, ketersediaan obat-obatan dasar, serta kenyamanan ruang pelayanan. Kedua, perlu dilakukan penambahan tenaga medis atau petugas kesehatan profesional, terutama pada jam-jam sibuk, agar pelayanan dapat diberikan lebih cepat dan menyeluruh. Ketiga, universitas dapat mengembangkan layanan kesehatan digital atau sistem pendaftaran daring, sehingga mahasiswa dapat melakukan konsultasi atau reservasi layanan dengan mudah. Selain itu, perlu diperkuat program edukasi kesehatan preventif melalui seminar, pemeriksaan kesehatan rutin, dan kampanye hidup sehat bagi mahasiswa. Dengan langkah-langkah tersebut, kualitas dan aksesibilitas layanan kesehatan di UNG diharapkan semakin optimal, modern, dan berorientasi pada kesejahteraan serta kenyamanan mahasiswa.', 'Berdasarkan hasil Survei Kepuasan Mahasiswa Tahun 2024 terhadap layanan kemahasiswaan Universitas Negeri Gorontalo pada aspek Tangibles, khususnya terkait kecukupan aksesibilitas dan kualitas sarana prasarana layanan kesehatan, diperoleh nilai rata-rata sebesar 3,81 dari total 21 responden. Mutu layanan berada pada kategori A (Sangat Baik), dengan kinerja unit pelayanan dinilai sangat baik, tingkat kepuasan mencapai 95,24%, dan predikat keseluruhan sangat puas. Hasil ini menunjukkan bahwa mahasiswa menilai fasilitas dan akses terhadap layanan kesehatan di lingkungan kampus telah memadai, baik dari segi ketersediaan sarana seperti ruang kesehatan, alat medis dasar, maupun dari aspek kemudahan dalam memperoleh pelayanan. Pelayanan kesehatan dinilai cepat, ramah, dan mampu menjawab kebutuhan dasar mahasiswa, terutama dalam situasi darurat atau keluhan kesehatan ringan.', '2025-10-28 06:40:44', '2025-10-28 06:41:41'),
(207, 71, NULL, 19, 'Meskipun tingkat kepuasan sudah sangat tinggi, masih terdapat ruang untuk peningkatan agar kualitas layanan semakin optimal. Pertama, perlu dilakukan penguatan kapasitas dan keterampilan petugas BK melalui pelatihan lanjutan terkait manajemen waktu, penanganan krisis mahasiswa, serta penggunaan teknologi konseling modern agar pelayanan semakin responsif. Kedua, universitas dapat mengembangkan platform layanan konseling digital, seperti sistem reservasi online dan chat konseling cepat, untuk memperluas akses mahasiswa terhadap layanan kapan pun dibutuhkan. Ketiga, perlu diterapkan sistem monitoring dan evaluasi layanan yang rutin agar setiap keluhan, tingkat kepuasan, dan waktu respon dapat terukur secara objektif. Selain itu, penambahan jumlah tenaga konselor profesional juga dapat dipertimbangkan untuk memastikan setiap mahasiswa mendapatkan perhatian yang memadai. Dengan langkah-langkah tersebut, diharapkan layanan Bimbingan dan Konseling di UNG akan semakin cepat, tanggap, dan adaptif terhadap berbagai kebutuhan serta dinamika mahasiswa di lingkungan kampus.', 'Berdasarkan hasil Survei Kepuasan Mahasiswa Tahun 2024 terhadap layanan kemahasiswaan Universitas Negeri Gorontalo pada aspek Responsiveness, khususnya mengenai ketanggapan petugas BK dalam membantu mahasiswa dan memberikan jasa dengan cepat, diperoleh nilai rata-rata sebesar 3,81 dari total 21 responden. Mutu layanan dikategorikan A (Sangat Baik), dengan kinerja unit pelayanan dinilai sangat baik, tingkat kepuasan mencapai 95,24%, dan predikat keseluruhan sangat puas. Hasil ini menunjukkan bahwa mahasiswa merasa petugas Bimbingan dan Konseling (BK) memiliki kecepatan dan ketepatan yang tinggi dalam memberikan layanan bantuan, baik dalam menangani permasalahan pribadi, akademik, maupun sosial. Respon cepat yang diberikan oleh petugas BK menunjukkan adanya sistem pelayanan yang efisien dan berorientasi pada kebutuhan mahasiswa.', '2025-10-28 06:42:56', '2025-10-28 06:43:15'),
(208, 71, NULL, 55, 'Meskipun tingkat kepuasan sudah tergolong sangat tinggi, peningkatan kualitas penyampaian perkuliahan tetap perlu dilakukan untuk mempertahankan dan memperkuat mutu pembelajaran. Pertama, dosen dapat meningkatkan variasi metode dan media pembelajaran melalui penggunaan teknologi digital, video interaktif, dan pendekatan berbasis proyek agar pembelajaran lebih menarik dan kontekstual. Kedua, universitas perlu mendukung pengembangan kompetensi pedagogik dosen secara berkelanjutan melalui pelatihan inovasi pembelajaran, microteaching, serta workshop penyusunan bahan ajar yang adaptif terhadap gaya belajar mahasiswa. Ketiga, perlu diterapkan mekanisme umpan balik mahasiswa secara berkala untuk mengevaluasi efektivitas penyampaian materi dan menyesuaikan pendekatan mengajar sesuai kebutuhan peserta didik. Dengan langkah-langkah tersebut, diharapkan penyampaian materi oleh dosen semakin komunikatif, inspiratif, dan mampu meningkatkan kualitas proses belajar-mengajar di Universitas Negeri Gorontalo.', 'Berdasarkan hasil Survei Kepuasan Mahasiswa Tahun 2024 terhadap layanan dan proses pelaksanaan pendidikan di Universitas Negeri Gorontalo pada aspek Reliability, khususnya terkait penyampaian dosen dalam materi perkuliahan, diperoleh nilai rata-rata sebesar 3,76 dari total 21 responden. Mutu layanan dikategorikan A (Sangat Baik), dengan kinerja unit pelayanan dinilai sangat baik, tingkat kepuasan mencapai 94,05%, dan predikat keseluruhan sangat puas. Hasil ini menunjukkan bahwa mahasiswa menilai dosen telah memiliki kemampuan penyampaian materi yang baik dan konsisten, serta mampu menjelaskan topik perkuliahan dengan jelas, terstruktur, dan relevan dengan capaian pembelajaran. Selain itu, interaksi antara dosen dan mahasiswa dinilai cukup aktif dan mendukung pemahaman materi kuliah dengan baik.', '2025-10-28 06:44:44', '2025-10-28 06:44:55');
